BEGIN;

PREPARE insert_trail (text, text, text, geography[]) AS
    WITH trail AS (
        INSERT INTO
            trails (name, description, color)
        VALUES
            ($1, $2, $3)
        RETURNING id
    )
    INSERT INTO
        trail_sections (trail_id, geog)
    SELECT trail.id, UNNEST($4)
    FROM trail;

EXECUTE insert_trail( E'Tyresta by - Stensjödal (Åvaleden), 8 km'
                    , E'Lantlig bymiljö, orörd barrskog, brandområde och bäverdammar! Leden följer Sörmlandsleden och Bylsjöslingan, innan den svänger in på 1999 års brandområde. Här är leden röjd så att du kan vandra utan att gå vilse bland brötarna av fallna träd. Vid Stensjödal möts du av bäverhyddan i strandkanten.'
