EXECUTE insert_trail( E'Bylsjöslingan, 6 km'
                    , E'Bylsjöslingan bjuder på stämningsfull granskog men också annan natur. Första delen löper längs populära Barnvagnsslingan. Den södra delen av slingan är mer avskild och naturlig men kan vara blötare. Från vägskälet mot Stensjön, mitt på slingan, kan du göra en avstickare till 1999 års brandområde.'
                    , E'#7f532a'
