EXECUTE insert_trail( E'Storskogsslingan, 8 km'
                    , E'Storskogsslingan tar dig på en vandring längs grusvägar i norr, in mot Stensjön där stigarna tar vid och där det finns en eldplats. Missa inte den imponerande utsikten över sjöns småöar från fornborgen Stensjöborg strax intill. Längs Långsjöns fina klippstrand ligger ett vindskydd med eldstad.'
