EXECUTE insert_trail( E'Allemansråttans stig, 650 m'
                    , E'Allemansråttans stig handlar om allemansrätten. Stigen börjar och slutar precis bakom naturum Nationalparkernas hus i Tyresta by. Färgmarkeringar på träden leder till fem platser där Allemansråttan ger olika uppdrag och tips på saker att upptäcka.\n\nStigen lämpar sig för alla barn och deras vuxna – men tyvärr inte för barnvagn.\n\nAllemansråttans stig i Tyresta är framtagen av Tyresta nationalpark och Håll Sverige Rent.'
