EXECUTE insert_trail( E'Åpromenaden'
                    , E'Njut av en härlig promenad eller joggingtur längs med ett av Norrköpings populäraste motionsspår! Turen går längs Motala ströms norra strand, över Riksbron och tillbaka längs den södra sidan. Passa på att njuta av dofterna i örtagården på norra sida eller skönheten i Rhododendrondalen på strömmens södra sida. Visste du förresten att i naturen finns en vild rhododendron? Skvattram, den starkt doftande busken som växer på myrmark i våra skogar.'
