EXECUTE insert_trail( E'Kvillingeleden'
                    , E'Kvillingeleden är sammanlagt ca 10 km lång och uppdelad i tre slingor. Den går genom dramatisk terräng och är på sina ställen brant. Men den något ansträngande vandringen lönar sig. Från de tre fornborgarna har du en fantastisk utsikt över slätten bort mot Bråviken, Norrköping och Glan.'
