EXECUTE insert_trail( E'Leonardsbergsleden'
                    , E'Leden består av två slingor och är sammanlagt ca 4 km lång. Den västra slingan passerar vackra, betade strandängar med en rik flora och fågelliv samt fantastiska isräfflor. Den östra slingan går genom hagmark med ekbackar och här kan du titta på hällristningar och andra fornlämningar.'
