EXECUTE insert_trail( E'Ribbingsholmsleden'
                    , E'Vandringsleden som är 2 km lång tar dig genom en vacker betesmark med mäktiga gamla ekar. Flera av dem är innanmurkna med flera håligheter till glädje för hålhäckande fåglar, fladdermöss och en stor mängd olika skalbaggearter däribland den sällsynta läderbaggen . Från vandringsleden du se ut över sjön Glan.'
