EXECUTE insert_trail( E'Östgötaleden - Skönnarboleden'
                    , E'Cirka sju kilometer norr om Tjällmo börjar Skönnarboleden en av Östgötaledens vackra rundslingor. Den går genom skogslandskap med insprängd jordbruksmark och torp. Man går förbi fina betesmarker, bredvid vattendrag och sjöar. Leden är sammanlagt tio kilometer lång, men möjligheter finns att bryta av promenaden på flera ställen utan att behöva gå samma väg tillbaka. Exempelvis kan en vandra den norra slingan som är ca 8,1 km lång, men kan kortas av med genvägar. Den södra slingan blir omkring 2,1 km.\n\nUnder den första sträckan från starten vid Christinefors passerar du fall och hålldammar, minnesmärken från järnhanteringen och den efterföljande sågverksindustrin. Områdets historia går ända tillbaka till 1382.\n\nUppe vid kvarnruinen kan du beundra det stora vattenhjulet som invigdes 2002. Leden går sedan vidare på vägar och stigar genom skog av varierande ålder. En torpruin och en kolarplats får du se på den norra slingan.\n\nNorr om Skönnarbosjön går leden ut mot en udde. Det är fint att ta en avstickare ända ut på udden för en paus och ett dopp.\n\nDet finns en citatslinga på längs Östgötaleden för att inspirera till vandring och samtidigt lyfta fram lokala författare och illustratörer. I detta fall är det författaren Arvid Fredriksson, född och verksam i Tjällmo, vars texter har illustrerats av hans dotter Maria Tronnersjö. Värt att besöka!\n\nGuidningar vid Skönnarbo kan anordnas genom Tjällmo hembygdsförening. Som också är skötselförening för leden.\n\nVid starten på vandringsleden (Christinefors) är vi medvetna om att parkeringsplatserna stundtals inte räcker till. I väntan på en bra lösning på problemet ber vi er parkera längs vägen mitt emot parkeringsskylten. Vägen upp till de privata husen får inte blockeras och privata tomter får heller inte användas till parkering. Vi ber alla att visa hänsyn till de boende i området och gå bara längs ledens sträckning.'
