EXECUTE insert_trail( E'Övralid naturstig'
                    , E'För den som vill lära känna Heidenstams miljö räcker det inte med att besöka hans bostad och gravplats, det är minst lika intressant att själv vandra de stigar vår store diktare trampat och njuta av den rika flora och fågelsång han skattade så högt.\n\nNaturstigen är ca 2,5 km lång och löper genom varierande terrängtyper. Vid lugn promenadtakt tar det ca 1 timme att gå stigen. Man kan dock korta av promenaden genom att gå upp den på kartan blåmarkerade vägen från Ryttartorpet. Vi önskar Er en angenäm och trevlig promenad.'
                    , E'#7f532a'
