EXECUTE insert_trail( E'Motalarundan terränglöpningsspår (8 km) i Fålehagen'
                    , E'Motalarundan är ett cirka 8 km långt terränglöpningsspår i Fålehagen med vita markeringar. Spåret är kuperat och utmanande med långa backar i varierande naturmiljö. I västra delen av Fålehagen belönas man med mycket vacker utsikt över Vättern. Motalarundans start är vid Fålehagsstugan, men det går bra att haka på slingan t.ex. vid Vadstenavägen ner från Motalabron, eller ifrån Södra Freberga. I delar av spåret delas sträckningen med terrängcykelbanan.'
