EXECUTE insert_trail( E'Fålehagens Elljusspår, 2 km, 3 km och 5 km'
                    , E'Promenad, löpning, orientering eller skidåkning? I Fålehagen finns alla möjligheter till motion och rekreation i naturen. Motionsspåren på två kilometer, tre kilometer och fem kilometer är elbelysta. Vid snötillgång anläggs skidspår av Motala AIF Skidklubb. Om det finns tillräckligt med snö prepareras skidspår (fem kilometer) även på golfbanan. Vid spåren finns en dusch- och omklädningsbyggnad. Den är öppen dagligen 08.00-22.00. Här finns också en klubbstuga/samlingslokal tillgänglig för uthyrning till föreningar, skolor och allmänheten. För uthyrning, kontakta Motala AIF.'
