EXECUTE insert_trail( E'Fålehagens Terrängcykelbana'
                    , E'I Fålehagen finns det möjlighet att cykla i terrängen längs med en markerad terrängcykelbana. Starten är vid Fålehagsstugan. Det finns en två slingor att följa, en på 5 km och en på 4km. Tänk på att enbart följa den utmärkta leden, samt att alltid visa hänsyn och lämna företräde till andra motionärer när du korsar över andra spår. \n\nPå vissa ställen går MTB-spåret på samma ställe som löparspåret Motalarundan. Det är därför extra viktigt att alla visar hänsyn till varandra! All cykling sker på egen risk.'
                    , E'#7f532a'
