EXECUTE insert_trail( E'Naturstig runt Mariebergsudden'
                    , E'Välkomna ut på en naturpromenad vid Vättern runt Mariebergsudden. En ledmarkerad rundslinga led dig utmed stranden, med start vid södra Varamobaden. Stigen närmast vattnet runt udden är lite mer strapatsrik och naturlig, men uppe på udden har däremot stigen grusats upp för att göra det lättare att gå med t.ex. barnvagn. Längs med stigen finns bland annat en grillplats och en naturminnesskyddad ek. Ekhagmarken ovanför branten betades av får in på 70-talet och har varit under igenväxning under lång tid. Genom röjning och gallring har hagmarkskaraktären infunnit sig på nytt. Så småningom förväntas även den beteskrävande och ljusälskande floran återvända.'
                    , E'#7f532a'
