                    , E'I det natursköna friluftsområdet på Råssnäsudden finns ett elbelyst motionsspår på cirka 1,3 km. Det går bra att kombinera elljusspåret med att springa runt själva Råssnäsudden där det går en promenadstig på cirka 2,5 km.'
