EXECUTE insert_trail( E'Motionsspår runt Råssnäsudden'
                    , E'Runt Råssnäsudden går en promenadstig som lämpar sig väl för såväl promenader som för löpning. Här får man fantastisk utblick över Vättern bland tallar och ekar. Spåret runt udden är cirka 2,5 km och tillgänglig med barnvagn och rullstol. Ute på udden finns en rastplats med bänkbord.'
