EXECUTE insert_trail( E'Elljusspår på Bondebacka'
                    , E'Elljusspåret på Bondebacka är cirka 2,5 km långt och snöröjs vintertid. Spåret går genom varierad terräng med både hassellundar med grova ekar, tallskogsmiljö och ute på det öppna radiofältet. Starten för spåret är vid parkeringen till radiomuseet. Längs med spåret finns ett utegym. Vill du ha lite extra träning så kan du nyttja backarna ner till Platengymnasiet för backintervaller.'
