EXECUTE insert_trail( E'Vandringsled mellan Staffanstorp och Charlottenborg'
                    , E'Från Staffanstorps naturreservat kan man enkelt vandra norrut på den rödmarkerade vandringsleden till Charlottenborgsområdet genom naturområdet där får betar sommartid. Den gulmarkerade vandringsleden tar dig sedan vidare till Sjöbo-Knäppans naturreservat. Tänk på att hålla hunden kopplad i fårhagarna och att alltid se till att grindarna är stängs igen efter dig!\n\n'
