EXECUTE insert_trail( E'Östgötaleden - Vandringsled till Birgittas udde'
                    , E'En delsträcka av Östgötaleden ut till Birgittas udde. Från parkeringsplatsen vid Ulvåsa är det sedan ca 2,5 km orangemarkerad led ut till Birgittas udde, som man får vandra eller cykla. Vägen är inte öppen för biltrafik, utan området ska vara en plats för fysisk och andlig rekreation och naturupplevelser. Del av pilgrimsleden.\n\nLeden går förbi betesmarker, produktionsskog längs Borens strand och går sedan ut i en fin fårhage ute på udden.'
                    , E'#7f532a'
