EXECUTE insert_trail( E'Vandringsled i Trolleflod'
                    , E'I Trollflods naturreservat finns en markerad vandringsled med två olika långa slingor, den längre ca 2 km. Vandringsleden passerar tre kolbottnar och en gammal spismur. Kolbottnarna framträder som ringformade upphöjningar i marken och är läm­ningar från den tid då man i området framställde träkol i kolmilor.\n\nNaturreservatet förvaltas av Länsstyrelsen Östergötland.'
                    , E'#7f532a'
                    , ARRAY[ 'LINESTRING (15.395883 58.826905, 15.395482 58.827499, 15.394852 58.827734)'
