EXECUTE insert_trail( E'Vandringsled på Håleberget'
                    , E'Vandringslederna på Håleberget är delvis branta och kan vara mycket strapatsrik vid regnig väderlek. Det finns två vandringsleder att välja bland; den gulmarkerade som är 700 m lång och den orangemarkerade som är 2,1 km lång.Väl uppe på toppen belönas man dock med storslagen utsikt över Vättern och Omberg.\n\nNaturreservatet förvaltas av Länsstyrelsen Östergötland.'
                    , E'#7f532a'
