EXECUTE insert_trail( E'Vandringsstigar i Sjöbo-Knäppans naturreservat'
                    , E'I Sjöbo-Knäppan finns ett antal skyltade vandringsstigar som går genom reservatet från slaggbron över Motala ström i väster, till Hulthagekärret i öster. Det finns också möjlighet att vandra en markerad vandringsled till Staffanstorps naturreservat över Charlottenborgs naturområde.\n\nDelar av vandringsstigarna i de västra delarna går över vad som tidigare var slaggtipp. Det kan finnas en del slagg, skrot och skräp i området som härrör från slaggtippen.\n\nDelar av varingsstigarna, exempelvis mellan Sjöbotorpet och Gröna plan är tillgänglighetsanpassade.'
