EXECUTE insert_trail( E'Vandringsstigar i Dansätter'
                    , E'Intill Motala ström i Borenberg ligger detta tätortnära naturområde med bland annat lövskog. Mellan villabebyggelsen och sjön Boren finns en bred remsa med naturmark. Området har trots frånvaron av hävd fortfarande karaktären av ett äldre odlingslandskap med gamla skogsbeten, öppna hagmarker och åker. Längs stranden löper en stig mellan små badplatser.'
