EXECUTE insert_trail( E'Vandringsled genom naturreservaten vid Fågelmossen'
                    , E'Mitt mellan Motala, Tjällmo, Borensberg och Godegård ligger ett komplex av myrmarker som skyddas som naturreservat. En vandringsled binder ihop naturreservaten. Vandringsleden är tydligt uppmärkt med orange färg, och det finns vägvisningspilar och ledkartor längsmed vägen som hjälp. Vissa sträckor av leden är ofta väldigt blöta så höga kängor eller stövlar är att föredra. Leden är stundtals något igenväxt vilket ger en härlig gammelskogskänsla.\n\nPå naturkartan finns en ledkarta digitalt som pdf som går att ladda hem.\n\nNaturreservaten förvaltas av Länsstyrelsen Östergötland.'
