EXECUTE insert_trail( E'Hägernäs strandpromenad'
                    , E'Värtans stränder erbjuder en vacker och varierande strandpromenad året om. Särskilt välbesökt är strandpromenaden från islossning till isläggning. Men även vintertid, när isen ligger blank, söker sig många täbybor till Värtan för att med skridskor ta sig ut till Tornön eller Bastuholmen.\n\nTäbys stränder utmed Stora Värtan har stora kultur- och naturvärden och här finns några av kommunens största tillgångar vad gäller rekreation och friluftsliv både i form av anlagd parkmark, men även i naturlig miljö.\n\nLängs promenadvägen finns ett antal informationsskyltar för att göra promenaden ännu mer intressant och trivsam. Där det behövs finns också ledstolpar för att hjälpa dig att hitta fram.'
                    , E'#7f532a'
                    , ARRAY[ 'LINESTRING (18.116425 59.436754, 18.116558 59.436795, 18.116739 59.437063, 18.116879 59.437107, 18.117380 59.437403, 18.117754 59.437515, 18.118113 59.437501, 18.118264 59.437575, 18.118834 59.437407, 18.119538 59.437239, 18.120031 59.437175, 18.120659 59.437135, 18.121045 59.437132, 18.121582 59.437132, 18.122123 59.437134, 18.122712 59.437140, 18.123055 59.437118, 18.123862 59.437053, 18.124034 59.436954, 18.124045 59.436902, 18.124202 59.436862, 18.124423 59.436832, 18.124729 59.436771, 18.125134 59.436770, 18.125493 59.436793, 18.126414 59.437050, 18.126538 59.437359, 18.126673 59.437507, 18.126886 59.437604, 18.127055 59.437799, 18.126977 59.437970, 18.126697 59.438148, 18.126426 59.438431, 18.126787 59.438691, 18.126945 59.438782, 18.127012 59.438908, 18.126822 59.439228, 18.126778 59.439394, 18.126947 59.439720, 18.127026 59.439886, 18.127138 59.440120, 18.127127 59.440326, 18.126993 59.440669, 18.127050 59.440783, 18.127405 59.441105, 18.127439 59.441192, 18.127533 59.441371, 18.127714 59.441698, 18.128051 59.441869, 18.128366 59.442212, 18.128838 59.442520, 18.129198 59.442657, 18.129849 59.442703, 18.130334 59.442690, 18.130585 59.442626, 18.131196 59.442645, 18.131825 59.442839, 18.132500 59.443181, 18.132814 59.443261, 18.133488 59.443307, 18.134117 59.443432, 18.134791 59.443558, 18.135269 59.443639, 18.135506 59.443678, 18.135846 59.443740, 18.136134 59.443778, 18.136194 59.443812, 18.136260 59.443883, 18.136256 59.444350, 18.136403 59.444899, 18.136444 59.445207, 18.136432 59.445490, 18.136208 59.445692, 18.135852 59.445820, 18.135681 59.445995, 18.135698 59.446428, 18.135818 59.446861, 18.135779 59.447370, 18.135759 59.447902, 18.135551 59.448039, 18.135245 59.448153, 18.134670 59.448234, 18.134507 59.448474, 18.134496 59.449642, 18.135174 59.451017, 18.135835 59.451945, 18.136601 59.452682, 18.137516 59.453716, 18.138070 59.453875, 18.138608 59.453912)']::geography[]);

