EXECUTE insert_trail( E'Fornslingan, Hagby-Mörtsjön'
                    , E'Fornslingan utgår från den Gröna Entréen vid Hagby gård, på västra sidan av Hagbyvägen.\n\nI området kring Vallentunasjön finns ovanligt många runstenar från vikingatidens slut. Vid Hagby gård och i markerna där omkring känns närheten till Jarlabanke, denne vikingatida storman mer omtalad och omskriven än någon annan täbybo. Följer man slingan mot söder kommer man snart till två runhällar på en bergholme och snart syns spåren av en gammal hålväg.'
