EXECUTE insert_trail( E'Skogsslingan, Hagby-Mörtsjön'
                    , E'Skogsslingan utgår från den Gröna Entréen intill  parkeringsplatsen vid Täbyvägen/Hagbyvägen och passerar genom skogsmark med en variation  av kärr- och mossmarker, blockterräng, bäckravin och bergknallar. Här kan man stöta på rådjur och hare. I området finns blåbär, lingon och våra vanligaste svampar som kantarell och karljohan.\n\nTrots närheten till bebyggelsen upplever man en påtaglig skogskänsla utefter hela slingan.'
