EXECUTE insert_trail( E'Vandringsled i Hälla ädellövskog'
                    , E'Vandringsled i Hälla ädellövskog. Naturreservatet är knappt 22 ha stort och ligger ca 1 km nordväst om Godegård kyrka i Motala kommun. Området är mycket vackert med omväxlande lövskogstyper som bjuder på ymnig vårblomning, porlande källflöden och rik fågelsång i försommartid. Här får besökaren uppleva olika lövskogstyper i sluttningen, från lågvuxen krattekskog, skir björkskog, översilat askkärr till frodvuxen lövskogslund.\n\nNaturreservatet förvaltas av Länsstyrelsen Östergötland.'
