EXECUTE insert_trail( E'Blåvättnerna - Stensjön, Bohusleden, etapp 1'
                    , E'Bohusleden består av 27 etapper som bjuder på totalt 37 mil av naturskön och omväxlande vandring. Leden sträcker sig från Lindome i söder, vid gränsen mot Halland, till Strömstad i norr. \n\n\nSträckan är relativt lätt att vandra, men ändå lång nog att den känns längre än en promenix. Efter fullföljd vandring har du avverkat närmare två mil av Nordsjöleden/Bohusleden. Start vid Blåvättnerna nära gränsen till Halland. Målgången sker norrut, vid Stensjön i Mölndal.\n\nPå vägen: Vid Stora Hassungaredssjön ﬁnns bad och grillplats, vindskydd och WC. Herkulesgården har ett vindskydd. Gunnebo Slott med sitt kända café ligger lägligt som avrundning för Bohusledens första etapp.\n\nBild: Dennis Lundqvist, Johan Bengtsson (CCBY2.0)'
                    , E'#7f532a'
