                    , E'Bohusleden består av 27 etapper som bjuder på totalt 37 mil av naturskön och omväxlande vandring. Leden sträcker sig från Lindome i söder, vid gränsen mot Halland, till Strömstad i norr. \n\nEtapp två är drygt åtta kilometer lång och lättvandrad på stigar. Med start i Mölndal vid Stensjön, passera riksväg 40 norrut och du befinner dig snart i naturreservatet Delsjöområdet och därmed i Göteborgs kommun. \n\nPå vägen: Delsjön är den största sjön, där bad och fiske (gult kort) är möjligt. I Skatås finns många motionsslingor, aktiviteter, parkering och en motionscentral. \n\nBild: Dennis Lundqvist (CCBY2.0)'
