EXECUTE insert_trail( E'Skatås - Kåsjön, Bohusleden, etapp 3'
                    , E'Bohusleden består av 27 etapper som bjuder på totalt 37 mil av naturskön och omväxlande vandring. Leden sträcker sig från Lindome i söder, vid gränsen mot Halland, till Strömstad i norr. \n\nMed start i Skatås tar vandringen dig genom naturreservatet Knipeflågsbergen som gränsar till Delsjöområdet. Leden bär dig mot sjöarna Prästtjärn och slutdestinationen Kåsjön. Vandringen är förhållandevis lätt och den totala längden är ungefär åtta och en halv kilometer.\n\nPå vägen: Härlanda tjärn med fint bad, Getryggen med sin fantastiska utsikt och den stora och populära badplatsen i Kåsjön.\n\n\nBild: Staffan Edvardsson, Niklas Gustavsson (CCBY2.0)'
