EXECUTE insert_trail( E'Kåsjön - Jonsered, Bohusleden, etapp 4'
                    , E'Bohusleden består av 27 etapper som bjuder på totalt 37 mil av naturskön och omväxlande vandring. Leden sträcker sig från Lindome i söder, vid gränsen mot Halland, till Strömstad i norr. \n\nLätt vandring, mestadels på stigar under totalt nio kilometer. Med start i Kåsjön i Partille kommun till Jonsered.\n\nPå vägen: Kåsjön med sin stora badplats samt sommarserveringen. Du passerar den fågeltäta sjön Maderna vilket är ett guldkorn för intresserade. Råhults våffelstuga är värt ett besök, dock bara vinteröppet mellan Jan-Mars. En omväg till Laxfisket i Säveån kan vara värt mödan. \n\nBild: Staffan Edvardsson (CCBY2.0)'
