EXECUTE insert_trail( E'Fontin - Grandalen, Bohusleden Etapp 7'
                    , E'Bohusleden består av 27 etapper som bjuder på totalt 37 mil av naturskön och omväxlande vandring. Leden sträcker sig från Lindome i söder, vid gränsen mot Halland, till Strömstad i norr. \n\nMedelsvår vandring, i naturreservat under totalt 19 kilometer i Kungälv. Vandring sker i lövskogar och över en skogsklädd bergsplatå.\n\n\nPå vägen: Den populära Kärleksstigen går via bergskanten mot Nordre älv. Vacker utsikt över Kungälv, älvarna och Bohus Fästning. Svarte Mosse är en näckrostät tjärn. Om du bestiger Aleklättens topp når du drygt 134 m.ö.h och får se en svindlande vacker utsikt över omgivningarna. Rastplats finns vid Romesjön eller Dalen.\n\nBild: Staffan Edvardsson (CCBY2.0)'
                    , E'#7f532a'
