EXECUTE insert_trail( E'Grandalen - Bottenstugan, Bohusleden Etapp 8'
                    , E'Bohusleden består av 27 etapper som bjuder på totalt 37 mil av naturskön och omväxlande vandring. Leden sträcker sig från Lindome i söder, vid gränsen mot Halland, till Strömstad i norr. \n\nMedelsvår vandring, på nätet av strövstigar under totalt 7.5 kilometer. Tillgång till utsiktsplatser, badplatser, paddling och fiske. Vandringsvana och bra kondition är att föredra, terrängen är väldigt kuperad på sina ställen.\n\nPå vägen: I Svartedalen är fiske möjligt (fiskekort krävs, finns att köpa vid Grandalens korsning). Vid Tvängen finns vindskydd för övernattaren. Under vägen passerar du Stora Kattås ligger på 175 m.ö.h som sedan leder till slutstation vid Bottenstugan.\n\nBild: Staffan Edvardsson (CCBY2.0)'
                    , E'#7f532a'
