EXECUTE insert_trail( E'Bottenstugan - Lysevatten, Bohusleden Etapp 9'
                    , E'Bohusleden består av 27 etapper som bjuder på totalt 37 mil av naturskön och omväxlande vandring. Leden sträcker sig från Lindome i söder, vid gränsen mot Halland, till Strömstad i norr. \n\nMedelsvår kuperad vandring, genom Svartedalen under totalt 11.5 kilometer i Kungälv. Området är känt för b.la. sportfiske, svamp- och bärplockning samt orientering.\n\nPå vägen: Med start i Bottenstugan (här startar flera leder), fortsätter vandringen in i Svartedalens vildmark och naturreservat. Under vandringen bjuder Härsvatten på utsiktsplatser. Vid slutet av etappen ligger Gårdsjön (tips att gå runt och observera miljöforskningen på försurning som sker i området).\n\nBild: Staffan Edvardsson (CCBY2.0)'
                    , E'#7f532a'
