EXECUTE insert_trail( E'Bella blåmes trädstig på Bondebacka'
                    , E'I skogsdungen mellan motionsspåret på Bondebacka vid förskolan Ekparken och naturförskolanförskolan Bondebacka finns Bella blåmes trädstig. Längs med trädstigen som är ca 200 m lång presenterar Bella blåmes olika trädslag som växer på Bondebacka. Stigen passar lika bra för barn som för vuxna. Spanar man upp bland träden kan man även hitta Bella blåmes sittande på en gren tillsammans med hennes fågelkompisar i skogen.'
                    , E'#7f532a'
