EXECUTE insert_trail( E'Blå leden Etapp 3 (Anslutningsled - Prästfjärden)'
                    , E'Etappen som är cirka 6,5km sträcker sig från vägskälet vid Lilla askdalen genom skogslandskapet via grusvägar och stigar norrut mot väg 276. Vid Stava går Blå leden under väg 276 för att sedan slingra sig in genom tomtområdet med både fritids- och permanentboende.  Därefter sträcker sig leden ner mot Stora Stava med flera hästhagar vidare förbi det gamla tingshuset mot Åkersbro och Åkers kanal. Vid vägskälet finns en anslutande led till Roslagleden.'
