EXECUTE insert_trail( E'Lövhagen-Domarudden, Roslagsleden etapp 4'
                    , E'Etappen mellan Lövhagen och Domarudden är 12 km. Etappen går initialt utefter asfalterad väg ett par kilometer för att därefter mestadels gå längs med skogsbilvägar mot Domarudden. Leden passerar Brållsta golfbana med servering, \nVid Harsjön finns ett vindskydd i naturskönt läge med möjlighet till bad. Leden sträcker sig vidare längs Tärnans västra strand och förbi Bromseby naturreservat och strax öster om Tärnan ligger naturreservatet Exerman-Hersby. I området kring Tärnan finns höga naturvärden med de många sjöarna och de gamla skogarna.\nRoslagsleden går vidare söderut mot Trehörningsskogens naturreservat med vindskydd och grillplats vid sjön Trehörningens norra strand. Etappen når tillslut Domaruddens friluftsgård invid Drängsjön. Vid Domaruddens friluftsgård flertalet faciliteter.'
