EXECUTE insert_trail( E'Domarudden-Wira bruk, Roslagsleden etapp 5'
                    , E'Etappen som är 20 km från Domaruddens friluftsgård till Wira bruk bjuder på vandring i ett sjörikt skogslandskap på både sitgar och skogsbilvägar. Efter ca fem km vandring finns en rastplats med grillplats vid Oppsjön. Leden sträcker sig norrut förbi Mörtvättern och vidare mot Nickmora och längs med Virens norra strand och Blötviken som är ett Natura 2000-område. Ett par kilometer innan Wira bruk ligger en bad- och rastplats invid sjön Viren med fint badvatten. Etappmålet Wira bruk är en unik kulturmiljö med välbevarade vapensmedjor.'
