EXECUTE insert_trail( E'Vandring i ekskogsmiljö vid Ekenäs'
                    , E'Från Aspska villan vid Ekenäs kan man promenera genom en gammal vacker ekskogslund längs med Motala ström. Vid Slaggbron kan man sedan välja att fortsätta vidare mot Sjöbo-Knäppans naturreservat. Vid Motala ströms strand finns en liten rastplats där man kan sitta och njuta av utsikten över Motala ströms grönskimrande vatten. Längs med stigen finns det ett stort antal mycket gamla och grova ekar. En informationsskylt längs med stigen berättar om gamla och grova träd.'
