EXECUTE insert_trail( E'Skidspår på Golfbanan, 10 km'
                    , E'På golfbanan söder om Fålehagen spårar MAIF skidklubb upp skidspår när snö finns. På golfbanan finns två slingor som tillsammans blir 10 km. Ingen belysning finns så är det mörkt rekommenderas pannlampa. I Fålehagen strax norr om golfbana finns vid snötillgång belysta skidspår. Här finns det tre olika slingor: 2 km, 3 km och 5 km. Vid Fålehagsstugan finns det omklädningsrum och dusch. För spårinformation ring 0141-51400 (spårinformation, Motala AIF Skidor).'
