                    , E'I Ödeby ca 9 km norr om Motala finns motionsspår på 2 km (blåmarkerat) och 5 km (rödmarkerat). Markeringarna kan vara dåligt underhållna och därför kan det på sina håll vara svårt att hitta. I området finns många populära och fina leder för både terrängcykling, promenader och löpning. Ridstigar, svamp och bär förekommer också i området. Tänk dock på att allemansrätten råder i området och att t.ex. ridning och terrängcykling inte får ge upphov till skada för markägaren.'
