EXECUTE insert_trail( E'Domkyrkan i Linköping - Berg, Birgittaleden, Östgötaleden'
                    , E'Denna del av Östgötaleden följer gång- och cykelvägarna från Berg in mot centrala Linköping. Längs med leden kan en beskåda både fin kulturmiljö och fin naturmiljö. En passerar Vreta kloster som uppfördes runt 1100-talet av kung Inge den äldre (Inge Stenkilsson) och drottning Helena. På denna sträcka passerar en också Svartån.\n\nBirgittaleden är en pilgrimsväg som knyter ihop delar av den heliga Birgittas liv, i dåtid och nutid. På Birgittaleden är du välkommen att vandra eller cykla på lätt framkomliga vägar. Det finns goda övernattningsmöjligheter (bl.a. fem STF vandrarhem, många hotell och pensionat) och tillgång till affärer och matställen. Birgittaleden är inte markerad i terrängen, men sammanfaller på vissa sträckor med Östgötaleden. Mer information om leden, kartor och vägbeskrivningar finns att hitta på Pilgrimscentrums hemsida. Du kan börja din vandring vid Linköpings domkyrka eller på någon annan plats du väljer längs med Birgittaleden.\n\nPå Naturkartan är Birgittaleden uppdelad i fyra delsträckor. Sträckan mellan Linköpings domkyrka och Vreta Kloster är 12 km lång.\n\n'
