                    , E'Birgittaleden är en pilgrimsväg som knyter ihop delar av den heliga Birgittas liv, i dåtid och nutid. På Birgittaleden är du välkommen att vandra eller cykla på lätt framkomliga vägar. Det finns goda övernattningsmöjligheter (bl.a. fem STF vandrarhem, många hotell och pensionat) och tillgång till affärer och matställen. Birgittaleden är inte markerad i terrängen, men sammanfaller på vissa sträckor med Östgötaleden. Mer information om leden, kartor och vägbeskrivningar finns att hitta på Pilgrimscentrums hemsida.\n\nPå Naturkartan är Birgittaleden uppdelad i fyra delsträckor. Sträckan mellan Motala och Vadstena är 20 km. Det finns två olika vägval som det går att läsa mer om på Pilgrimscentrums hemsida.\n\n'
