EXECUTE insert_trail( E'Malmbyrundan'
                    , E'Malmbyrundan är en 106 km lång träningsrunda som rekommenderas av Södertälje cykelklubb. Start vid Östergatan och slut vid Södertälje station.\n\nSträckan går via Gamla Strängnäsvägen till Mariefred, vidare till Stallarholmen och därefter till Malmby. Där finns det möjlighet till en paus och fika. Sedan Gamla E20 till Mariefred. Sväng höger vid Nykvarn och ta Tvetavägen hem.'
