EXECUTE insert_trail( E'Torörundan'
                    , E'Torörundan har sin start och slut i Södertälje centrum och är 130 kilometer långt. Tag 225:an mot Nynäshamn, fortsätt mot Stora Vika tag höger då du passerat Stora Vika. Samma väg hem, 65+65km från torget.'
