EXECUTE insert_trail( E'Hälsans Stig - Tranås'
                    , E'Hälsans stig är ett internationellt koncept som i Sverige ägs av Hjärt- och lungsjukas riksförbund. Tanken är att kunna erbjuda lämplig och nära vandring även för den med nedsatt funktion. I Tranås är slingan ca 3 km lång och du går på ett bra oftast asfalterat underlag. Här rör du dig längs Svartåns forsande vatten och under sommaren är det särskilt vackert med alla blommor i Ekmarksparken. Det finns gott om bänkar att vila på längs vägen där den som behöver kan pusta ut en stund eller bara njuta av vattnet, grönskan och blomsterprakten runtomkring. Slingan är väl markerad med Hälsans stigs egna skyltar och det finns 3 informationstavlor längs vägen.'
                    , E'#7f532a'
                    , ARRAY[ 'LINESTRING (14.980341 58.033139, 14.980041 58.033094, 14.979724 58.033116, 14.978925 58.033307, 14.977670 58.033684, 14.977895 58.033860, 14.978490 58.034340, 14.978914 58.034633, 14.979172 58.034849, 14.979199 58.035030, 14.979241 58.035300, 14.979891 58.035650, 14.980261 58.035942, 14.980481 58.036237, 14.980926 58.036629, 14.981425 58.037123, 14.981623 58.037470, 14.981580 58.037606, 14.981495 58.037819, 14.981285 58.038123, 14.981216 58.038415, 14.981248 58.038583, 14.981409 58.038779, 14.981484 58.039071, 14.981495 58.039225, 14.981714 58.039384, 14.982026 58.039554, 14.982321 58.039716, 14.982600 58.039855, 14.982798 58.039940, 14.983361 58.040043, 14.984665 58.040386, 14.985727 58.040610, 14.986183 58.040636, 14.986398 58.040309, 14.986392 58.040230, 14.986188 58.040213, 14.985684 58.040153, 14.985523 58.040000, 14.985266 58.039952, 14.984987 58.039957, 14.984584 58.039912, 14.984375 58.039841, 14.983898 58.039665, 14.983581 58.039458, 14.983597 58.039145, 14.983613 58.038961, 14.983206 58.038929, 14.983222 58.038756, 14.983356 58.037206, 14.983308 58.037024, 14.982471 58.036283, 14.982085 58.036090, 14.981892 58.035999, 14.981731 58.035845, 14.981682 58.035672, 14.981747 58.035451, 14.982020 58.035028, 14.982176 58.034817, 14.982331 58.034715, 14.982492 58.034579, 14.982605 58.034471, 14.983072 58.034437, 14.984091 58.034951, 14.984102 58.035167, 14.984209 58.035272, 14.985368 58.035104, 14.985845 58.034931, 14.987047 58.034542, 14.987572 58.034326, 14.987674 58.034187, 14.987728 58.033951, 14.987755 58.033389, 14.987755 58.032798, 14.987149 58.032761, 14.987411 58.032653, 14.987513 58.032455, 14.987283 58.032443, 14.986655 58.032392, 14.985443 58.032321, 14.984740 58.032341, 14.984123 58.032398, 14.983909 58.032338, 14.980679 58.032917, 14.980448 58.032980)']::geography[]);

