EXECUTE insert_trail( E'Rösjön runt'
                    , E'Rösjön runt är markerad med blå trianglar och tar dig på en 5,5 km lång slinga på mindre stigar runt Rösjön. Största delen av leden går i Rösjöskogens naturreservat i Sollentuna kommun men i söder går leden en kort sträcka genom Rinkebyskogens naturreservat i Danderyds kommun. Rösjön runt går i huvudsak på skogsstigar men på några sträckor följer leden elljusspår och grusvägar. Går du norrut från Rösjöbadet passerar leden barrskog längs med Rösjöns västra strand. Två grillplatser finns längs med denna sträcka och framme vid Kolartorp finns ytterligare en grillplats. Leden rundar Rösjöns norra ände och följer sedan östra sidan av Rösjön ner mot badplatser på Danderydssidan.'
