EXECUTE insert_trail( E'Skogsstigen i Rösjöskogens naturreservat'
                    , E'Skogsstigen är en 2,5 km lång vandringsled i Rösjöskogens naturreservat. Leden är markerad med gröna trianglar och är lätt att följa. Skogsstigen går mellan busshållplatsen Rösjön utmed Danderydsvägen i söder och Södersätra i norr. Du kan vandra den i valfri riktning.I höjd med Rösjöskolan finns en grillplats med sittplatser och utlagd ved där du kan stanna och elda eller fika. Norrut går stigen stigen sedan förbi Jarlabankestenen som är en värdefull runsten med inskrifter från 1000-talet. Den sista sträckan upp mot Södersätra går i kanten av betesmarker.'
