EXECUTE insert_trail( E'Hälsans Stig - Örnsköldsvik'
                    , E'Promenaden går längs Höglandssjön och slingan är 7 km lång. Genom att ta bron över sjön längs Gimåtvägen kan du korta slingan. Det södra varvet blir då 4 km och det norra varvet lite drygt 3 km.\n\nLängs promenaden finns flera bänkar, bänkbord, grillplatser och vindskydd. Här finns även en tillgängliggjord fiskebrygga och ett fågeltorn. Under månaderna april-maj och september-oktober är sjön mellanlandningsplats för många flyttande sjöfåglar. Vid sjöns norra ände följer du Höglandsån och här håller bävrar ofta till. Runt den södra delen finns flera utegymsstationer där du kan träna hela kroppen. Det finns även två kompletta utegym vid stigen.\n\nVid eventuella frågor om underhåll kontakta Örnsköldsviks kommun.'
                    , E'#7f532a'
