EXECUTE insert_trail( E'Hälsans Stig - Herrljunga'
                    , E'De flesta börjar kanske sin vandring vid järnvägsstation eller på Storgatan i Herrljunga. Båda har beskrivits på ett spännande sätt i Stefan Andhés novell ”Fröken Browns sällsamma öde” som naturligtvis går att låna på biblioteket i Herrljunga vilket man strax kommer att passera. En utmärkt plats att slå sig ner och läsa eller bara vila benen kommer man till när man precis passerat nya kyrkogården. Håll bara utkik efter klockstapeln till vänster. Eller varför inte titta lite närmare på de spännande gamla gravfälten längs stigen strax innan? För den som orkar är en liten avstickare in i Hembygdsparken att rekommendera där det bland annat finns ett fint vagnsmuseum.'
