EXECUTE insert_trail( E'Hälsans Stig - Örebro'
                    , E'Hälsans Stig passerar flera sevärdheter i centrala Örebro slott: Örebro slott har varit stadens medelpunkt i över 700 år. I dag är den gamla försvarsborgen ett modernt och levande slott. Hamnmagasinet: Örebro hamn anlades i samband med Svartåns kanalisering på 1880-talet. I hamnen fanns förr två hamnmagasin varav det ena finns kvar. Wadköping: Med sina trähus och gårdar skildrar friluftsmuséet Wadköping Örebros äldre bebyggelse och stadsmiljö. Här finns museer, utställningar, café och matsal, träsvarvare, handelsbod, bageri och många andra spännande butiker och hantverkstäder.'
