EXECUTE insert_trail( E'Mälarpromenaden'
                    , E'Här kan man få en härlig promenad på knappt fem kilometer. Den slingrar sig fram nära strandkanten och sträcker sig från Norsborgs herrgård i väster till Slagsta färjeläger i öster. Den som vill stanna och bada hittar flera bra platser på vägen. Det finns också en stor badplats med bryggor och kiosk och en grillplats.\n\nPå vägen passeras en marina med en restaurant som är öppen sommartid. Nya skyltar längs sträckan berättar om det rika djurlivet och naturen runtomkring Mälarpromenaden. Det finns flera fornminnen i området.'
