EXECUTE insert_trail( E'Drevvikens rundisbana'
                    , E'Rundisbanan är ett samarbete mellan Stockholms stad och Haninge, Huddinge och Tyresö kommun. När isen bär är den 20 km lång och har nio av- och påfarter. \n\nNågra saker att tänka på: \n-Rundisbanan på sjön Drevviken är cirka 20 km lång.\n-Åkriktningen är högervarv, det vill säga medsols.\n-Omkörning sker till vänster (högertrafik).\n-All åkning sker på egen risk.\n-Använd säkerhetsutrustning som isdubbar, ispik, visselpipa och livlina.\n-Åk gärna tillsammans med någon.\n-Råkar (områden med öppet vatten) kan uppstå på sjön.'
