EXECUTE insert_trail( E'Äventyrsstigen'
                    , E'Äventyrsstigen går runt sjön Getaren i Lida naturreservat. Vandraren tar sig över höjder med vacker utsikt, genom djupa raviner samt gamla skogar. Följ de blå ledmarkeringarna. Leden är cirka 9 kilometer lång. Terrängen är bitvis vild och mycket kuperad, därav namnet! Detta är en stig som Friluftsfrämjandet en gång anlade.'
