EXECUTE insert_trail( E'Albysjöns rundisbanor'
                    , E'Då isen bär på Albysjön och snön har kommit  plogas två skridskoslingor, en på 1 km och en på 4 km. Även en större yta för lek och spel plogas. Vid hårt väder kan det vara svårt att hålla båda banorna i bra skick och då prioriteras långfärdsbanan (4 kilometers)'
