EXECUTE insert_trail( E'Aspens naturstig'
                    , E'En unik vandringsled på drygt sju kilometer runt sjön Aspens södra del. Leden för dig till intressanta kulturmiljöer, flera fornlämningar och många naturtyper, som Ekholmens naturreservat på halvön i nordost. Spänger och broar ger dig möjlighet att bekanta dig med blöta sumpskogar där det annars är svårt att ta sig fram. Vid Skräfsta finns en markerade avstickare som leder dig fram till en utsiktsplats med fina vyer över sjön.\n\n'
