                    , E'Spår med belysning på flera etapper och avståndsmarkeringar. Spåras för skidåkning vintertid. Spåret sköts av Karlslunds IF Skidor.\n\nBelysta spår\n\n1,2 km \n2,5 km \n3,1 km \n5 km\n\nEj belysta spår\n\n10 km \n15 km\n\nUnderlaget underhålls regelbundet för att hålla en bra kvalitet för dig som vill löpa/jogga. Sly och högt gräs hålls nere i spårets omedelbara närhet. \n•Tillgång till utegym. \n•Omklädningsrum. \n•Toalett . \n•Bastu. \n•Bilparkering. \n•Café.'
