                    , E'Venaspåret är ett belyst spår på 2,9 km med anslutning upp till Lillåspåret. Hela sträckan Vena-Lillåspåret utgör 10 km med belysning hela vägen. I området finns även grillplatser och vindskydd.\n\nParkering finns vid spårstart vid Korpralsgatan.\n\n'
