                    , E'I Karlslund finns mängder med promenadvägar att välja på. En del av sträckorna fungerar bra att ta sig fram på även med rullstol. I trädgården nedanför herrgården finns en slinga anpassad för både rullstol och synskadade, där man också kan få guidning i sin mobil via en app.'
