EXECUTE insert_trail( E'Oset och Rynningevikens promenadvägar'
                    , E'I Oset och Rynningeviken finns mängder av promenadstråk med hög tillgänglighet. Här tar man sig fram med både barnvagn, cykel och rullstol. Vägarna tar dig genom skogspartier, över betade strandängar och våtmarker, och ändå ut i Hjälmaren!'
