EXECUTE insert_trail( E'Sörmlandsleden'
                    , E'Du som känner för en vandringstur i äkta Södertörnsnatur kan ge dig av på en eller flera dagars vandring genom ett omväxlande landskap där vildmarken står i kontrast mot ängsmarker och små områden med bebyggelse. Det finns en särskild guidebok med speciella kartblad att köpa där olika delar av leden är inprickade. Leden är märkt med orangegula ringar runt träd och stolpar. Vindskydd och rastplatser finns längs leden. \n\nEtapp 2 börjar vid Skogshyddan och går till Alby friluftsgård. Denna sträcka är 6 km lång och går genom Nackareservatet och förbi Öringesjön. \nEtapp 3 går från Alby friluftsgård till Tyresta by, är 12 km lång och tar ca 4 tim att vandra.'
                    , E'#7f532a'
