EXECUTE insert_trail( E'Hemfjärden runt'
                    , E'Svårighetsgrad: Grön\n\nLängd: 38 km\n\nHöjdmeter: 90 m\n\nHemfjärden runt är cykelledernas cykelled här i Örebro. På rundan finns många olika sevärdheter så som naturreservat, historiska platser och vyer ut över Hjälmaren. Halvvägs på rundan finns ett sommarcafé vid Norra Ässundet, där kan fika eller ta en lunch och bada vid bryggbadet intill. Vid Norra Ässundet måste man åka över vattnet med cykelfärjan Åbäket, kostnaden för turen är 20 kr. Färjan avgår var 20:e minut och är bara öppen under sommarsäsongen juni till augusti. Färjan är bemannad onsdag till söndag mellan 12.00-18.00 med avgångar var 20:e minut.  \n Vid hård vind och dåligt väder går inte färjan.\n\n'
