EXECUTE insert_trail( E'Tysslingen runt'
                    , E'Svårighetsgrad: Grön\n\nLängd: 32 km\n\nHöjdmeter: 40 m\n \nUpplev det natursköna landskapet runt den näringsrika slättsjön Tysslingen. I väster följer leden siluetten av Kilsbergen – "De Blå Bergen". Tysslingen är mest känd för de tusentals sångsvanar, som varje år rastar under några tidiga vårveckor. Men Tysslingen har ett mycket rikt fågelliv året om. Varje år ses 160-180 arter i området.'
