EXECUTE insert_trail( E'Naturstig i Bromma friluftsområde'
                    , E'Bara ett stenkast från Varamobaden ligger ett mer avskilt strandområde med en vacker naturskog alldeles intill. Området var tidigare friluftsområde för Electrolux men ägs nu av kommunen. Genom skogen går en stig på ca 1 km där det Electrolux Korpenförening arrangerade tipspromenader. För den naturintresserade är stigen som går i området ett eldorado. Här finns ett rikt fågelliv och många ovanliga lavar och mossor som trivs i den orörda miljön med många döda träd. Vid stranden har man makalös utsikt över Vättern. Här kan man bada lite mer avskilt och i lugn och ro, jämfört med det mer folkrika Varamobaden.\n\nDetta är inte en utpekad kommunal badplats så här får man ha med sin hund när man badar.\n\n'
                    , E'#7f532a'
