EXECUTE insert_trail( E'Franciskusleden'
                    , E'Vandringsleden Franciskusleden går genom ett mycket vackert landskap nära Vättern. Här kan du vandra i en levande landsbygd med rum för själen och en intressant historia. Leden går också genom Biosfärområdet Östra Vätterbranterna - en av fem biosfärområden i Sverige. Sträcka; Byarum - Jönköping - Alvastra.\n\nLäs mer här: [www.franciskusleden.se](http://www.franciskusleden.se/start.php), [www.ostravatterbranterna.se](https://www.ostravatterbranterna.se/)\n\n'
