                    , E'Trakterna kring Tabergsån och Sandserydsån har under långa tider uppskattats för sin fina natur och varit omtyckta vandringsområden. Numera kan man följa de markerade lederna Hassafallsleden och Kallebäcksleden.\nHär möter du riktig John Bauerskog, en rolig strapats för barn. Det är rätt brant på vissa ställen. Varkullen bjuder på en fantastisk utsikt över staden.\n\nFoto: Jenny Abrahamsson'
