EXECUTE insert_trail( E'Getåravinens naturstig och vandringsled'
                    , E'Följ vandringsleden utefter Getån och njut av den fantastiska naturen. Längst ner i ravinen står ståtliga ekar omgivna av grova hasselbuketter. Lite högre upp växer gamla högresta granar, en pelarsal med en grön mossmatta. Getån med sitt klara vatten följer dig, ibland i snabbt tempo med små vattenfall och språng och ibland lugnare  i mjuka vida bågar. Om du går hela vandringsleden med slingan upp kring Stordalsbäcken och tillbaks igen är sträckan nästan 3 kilometer. För att ytterligare förhöja upplevelsen finns ett antal vackra träreliefer uppsatta utefter stigen. Där kan du se och lära dig mer om Getådalens innevånare!'
