EXECUTE insert_trail( E'Naturstig vid Norra Freberga löväng'
                    , E'I anslutning till Norra Freberga herrgård finns en lövskogslund med en rik flora. Flera av lundens askar är hamlade. På ett par platser växer den mycket sällsynta och hotade buskvickern. En naturstig med informationstavlor inbjuder till en promenad genom området. Naturstigen är ca 1,3 km lång och på vägen passerar man bland annat den pampig gammal ek som är naturminnesskyddad. I lövskogen växer det rikligt med skogsbingel.\n\nVälkomna till naturstigen och till parken, men låt blommorna stå kvar där de växer.\n\n'
