EXECUTE insert_trail( E'Bolletrampen'
                    , E'Bolletrampen, en rundtur i Klockrike. Upptäck Klockrike stationssamhälle under en halvtimmes promenad. Utmed Bolletrampen finns åtta skyltar med fotografier och text. Bolletrampen är i stort sett barnvagnsvänlig förutom grinden till skylt nr 8. På den pittoreska promenaden får man lära sig mer om bland annat Klockrikes gamla mejeri, smedja och stationshus. Man får också uppleva Klockrikes ödekyrkogård och Helge Björns gamla offerkälla. \n\nStarten på vandringsleden är vid Järnvägsparken i Klockrike. Leden är ca 2 km lång. Vid ishockeyrinken finns det grillplats och det finns flera möjligheter till sittplatser längsmed vägen.'
