                    , E'Den vackraste vägen mellan Huskvarna och Gränna. Längd: 53,7km. Start - eller mål - från IKHP-stugan till Tegnértornet. Leden går genom ett underbart och omväxlande landskap.\nEn alternativ sträckning från Västanå som går öster om Grännaberget (blir då 57,7km).\n\nEn del av Smålandsleden; [outdoor.smalandsleden.se](https://outdoor.smalandsleden.se)'
