EXECUTE insert_trail( E'Åstråket'
                    , E'Promenad- och joggingstråk utmed Svartån\n"Åstråket" går längs Svartån ut till Örebros citynära natur. \n\nBroar utmed ån gör det enkelt att välja mellan nio rundslingor i lätt och flack terräng. \n\nPå vägen från startpunkten vid Slottet tar du dig österut mot naturreservatet Oset och Rynningeviken vid Hjälmaren där du passerar Alnängarnas utegym eller västerut mot kulturreservatet Karlslund och Fallen.\n\nVill du få ut lite mer av din promenad så kan du starta den digitala guidningen på orebro.se/astraket. Då kan du ta del av berättelser i din telefon om intressanta platser som du passerar längst ån.'
