EXECUTE insert_trail( E'Hälsans Stig - Falun'
                    , E'Östanforsslingan är 4 km lång och det finns mycket sevärt längs vägen På Blindgatan ligger konstnären Carl Larssons stadsgård och etsarstuga intill varandra. Vid Stenvalvsbron började den gamla landsvägen som gick till norra Dalarna och till Röros i Norge. Tiskenslingan är inte sämre den utan erbjuder en fin promenad längs sjön och vid Kvarnberget uppfördes en hoppbacke redan 1907 med läktarplats för 200 personer och ett par år senare den kända Kopparvallen.'
                    , E'#7f532a'
