EXECUTE insert_trail( E'Hälsans Stig - Enköping Östra'
                    , E'Östra slingan går från Stora torget, upp via Drottninggatan till Resecentrum och vidare mot Bergvreten. Stigen går sen ner mot vattenparken, idrottshuset och in till centrum igen. Hälsans stig går genom centrala Enköping och genom fin naturmark. Den knyter ihop de gröna miljöerna i staden och hjälper dig att på ett enkelt sätt hitta en trevlig promenadväg. Stigen är sex kilometer lång men med några genvägar vid de brantaste partierna går det att korta ner promenaden. De träningssugna kan stanna till vid utegymmet vid Vitriskagatan. Vill man gå riktigt långt kan man gå både östra och västra slingan av Hälsans stig. Båda slingorna går via Stora torget. Stigen är belyst och snöröjs under vintern.\n\n'
