EXECUTE insert_trail( E'Frösviksrundan'
                    , E'Frösviksrundan är en 7,1 km lång vandringsled i varierande terräng. Längs med leden passerar man bland annat Kvarnberget och Lindskogen men även Tegelbrukshagen där man fram till början på 1800-talet hämtat lera för tegeltillverkning. Leden är markerad med rött i terrängen. En delsträcka är markerad cykelstig i terrängen anpassad till mountainbike.\n\n'
