EXECUTE insert_trail( E'Stortallsrundan'
                    , E'Stortallrundan är en 9,9 km lång vandringled som till stora delar samma sträckning som Frösviksrundan. Längs med Stortallsrundan passerar man Bogesundslandets största tall som leden fått sitt namn ifrån. Tallen är några hundra år gammal och har sedan en tid tillbaka fallit. Förutom tallen passerar man även Västerhaga fyr med utsikt över Askrikefjärden där man kan stanna till vid vindskyddet och grilla. Leden är markerad med orange i terrängen.\n\nEn del av sträckan är cykelstig anpassad efter mountainbike och markerad i naturen. Strckan går mellan Österhaga och strax norr om Västerhaga fyr.\n\n'
                    , E'#7f532a'
