EXECUTE insert_trail( E'Dammstakärrsrundan'
                    , E'Dammstakärrsrundan är en 10,8 km lång vandringsled i lätt till medelsvår terräng. En del av sträckan är anvisad cykelstig. Längs med leden passerar man flera rastplatser med vindskydd och grillplats. Leden är markerad med orange i terrängen. Leden är döpt efter Dammstakärret - en skogstjärn med vildmarkskänsla. Här kan du under våren höra storlommens ödsliga rop och under sommaren kan du ha turen att få se den ovanliga ljust gulgröna orkidén myggblomster. Vid Dammstakärret, våtmarkerna runt omkring och den skogsbevuxna myren trivs många olika växtarter. Därför är Dammstakärret ett Natura 2000-område och ingår i EU:s nätverk för skyddad natur.\n\nEn del av sträckan, från parkeringen söder om Dammstakärret, upp till Bogsättra och sträckan mellan Nibble och parkeringen norr om Sundbyberg är anvisad cykelstig för mountainbike.\n\n'
