EXECUTE insert_trail( E'Stora Slottssrundan'
                    , E'Den 8,5 kilometer långa Stora Slottsrundan tar dig genom vacker lövskog, genom Vaxholms vackra golfbana, längs med Ekefjärd och förbi Bogesunds Slott och Slottsvandrarhemmet. Kulturminnesmärken finns utmärkta längs med leden som till exempel Fridhem, där det låg en backstuga en gång i tiden. Den Stora Slottrundan når du enklast genom att parkera och starta vandringen från Bogesunds slott eller utgå ifrån parkeringen vid Fridhem. Leden är orange markerad i terrängen.\n\n'
