EXECUTE insert_trail( E'Råholmastigen'
                    , E'Råholmastigen är en vandring på drygt 2 km. Invid leden ligger den vackert belägna udden med Råholmens rastplats. Här finns vindskydd för övernattning och grillmöjligheter. Längs med vandringen kommer du fram till Holminge där det ligger ett röse från Bronsåldern.\n\nStigen är drygt 2 km enkel väg från parkeringen och vindskyddet ligger 800 meter från parkeringsplatsen.\n\n'
