EXECUTE insert_trail( E'Östgötaleden Berg - Trädgårdsföreningen'
                    , E'Östgötaledens etapp mellan Berg och Trädgårdsföreningen följer gång- och cykelvägarna över östgötaslätten och vidare längs Stångån och Kinda kanal in till centrala Linköping. Den är lättvandrad med huvudsakligen god tillgänglighet för funktionshindrade samt fungerar till stor del även utmärkt för cykling. Leden passerar bland annat Vreta klosters medeltida kyrka och klosterruin samt det mycket fågelrika Svartåmynningens naturreservat vid Roxen med vidsträckta betade strandängar. Här finns två fågeltorn anpassade för funktionshindrade. Större delen av etappen följer samma sträckning som pilgrimsvägen Birgittaleden.\n\nTrädgårdsföreningen från 1859 är en stor lummig park mitt i staden med caféer, Tropikhuset, Naturcentrummed mera. Inga vindskydd finns längs sträckan, men nära Trädgårdsföreningen ligger Linköpings vandrarhem.\n\nÖstgötaleden är markerad med orange färg.\n\n'
