EXECUTE insert_trail( E'Östgötaleden Trädgårdsföreningen - Gamla Linköping'
                    , E'Denna etapp av Östgötaleden följer huvudsakligen gång- och cykelvägar och har till största delen god tillgänglighet för funktionshindrade. Leden går från Trädgårdsföreningens lummiga parkmiljö till Gamla Linköping.\n\nTrädgårdsföreningen från 1859 är en stor lummig park mitt i staden med caféer, Tropikhuset, Naturcentrum med mera. I parkens närhet finns ett vandrarhem. Gamla Linköping är ett unikt friluftsmuseum bestående av en levande småstad med hitflyttade och nybyggda hus i gammal stil.\n\nLängs etappen passerar du Magistratshagens, Djurgårdens och Vallskogens inbjudande tätortsnatur. Du passerar även Linköpings Garnisonsmuséum där du kan lära dig mer om stadens militärhistoria.\n\nUngefär halvvägs längs etappen kommer du till Djurgården. Här kan du välja att vika av söderut in på Östgötaledens etapp mellan Djurgården och Vidingsjö. Här kommer du även in på Tinneröstigens rundslingor genom Tinnerö naturreservat.\n\nVäljer du att fortsätter etappen mot Gamla Linköping passerar du snart Valladammarna. Här finns en rastplats med eldstad. Den avslutande delen av etappen går genom Vallskogens naturreservat. Härifrån är det nära till Valla fritidsområde med bland annat lekplats, minigolfbana och vandrarhem.\n\nÖstgötaleden är markerad med orange färg.\n\n'
