EXECUTE insert_trail( E'Östgötaleden Djurgården - Vidingsjö'
                    , E'Denna etapp av Östgötaleden startar vid Djurgården i utkanten av Linköpings tätort. Därifrån följer leden längs skogsstigar och grusvägar och passerar naturreservaten Tinnerö eklandskap och Vidingsjöskogen. Etappen avslutas vid Vidingsjö motionscentrum, en anläggning för friluftsmotion. Här finns café, dusch och toalett.\n\nLeden passerar rastplatsen vid Sveden och i närheten vindskydden vid Djurgården och Tinnerö kärr. Dessutom passerar leden nära de anlagda fågelsjöarna Rosenkällasjön och Frökärret där det finns rastplatser och andra anläggningar för friluftslivet. Delar av etappen följer samma sträckning som Tinneröstigen.\n\nÖstgötaleden är markerad med orange färg.\n\n'
