EXECUTE insert_trail( E'Östgötaleden Vidingsjö - Bjärka-Säby'
                    , E'Denna etapp av Östgötaleden är relativt lättvandrad och följer stigar och småvägar från Vidingsjö motionscentrum till Bjärka-Säby. Leden går genom Vidingsjöskogen, Ekängsdalen, Ullstämmaskogen och förbi våtmarkerna vid Ullaberg. Därefter fortsätter den förbi inbjudande hagmarker, grova ekar och spännande kulturmiljöer. Delar av leden går längs den vackra Kinda kanal och du passerar bland annat slussmiljöerna vid Hamra och Hovetorp. Missa inte hembygdsgården Fornhemmet och Nya slottet när du kommer fram till Bjärka-Säby.\n\nVindskydd finns i Ekängsdalen strax söder om Vidingsjö samt vid Hovetorp. Sommartid finns det en liten kiosk vid Hovetorp och ett slottscafé vid Bjärka-Säby.\n\nLängs vandringsleden finns flera möjliga avstickare. I norr ansluter etappen till Östgötaledens rundslingor vid Ekängsdalen och Ullaberg och Mossen. Ungefär mitt på etappen kan du göra en avstickare västerut till det ålderdomliga och fornlämningsrika odlingslandskapet vid Hjortkälla. Platsen där du lämnar leden är markerad och området ligger ungefär en kilometer in längs en grusväg.\n\nEtappens sista 8 kilometrar, från Skog väster om Hamra till Bjärka-Säby, är en del av Östgötaledens 45 kilometer långa rundslinga runt sjön Rängen. Väljer du att gå rundslingan motsols viker du av söderut vid Skog, annars fortsätter du huvudleden mot Bjärka-Säby. Längs rundslingan finns bland annat sju badplatser, fyra vindskydd, tre kaféer, tre hotell/vandrarhem, en golfbana, tre kapell, två hembygdsgårdar och tre glasskiosker. Läs mer på [föreningen Rängen Runts webbplats](https://rangenrunt.se/).\n\nDet är möjligt att kombinera vandringen med att åka båt på Kinda kanal. M/S Kind går sträckan Linköping-Rimforsa fram och tillbaka. Det är möjligt att stiga på och av vid slussarna i kanalsystemet, det vill säga Hamra och Hovetorp för denna vandringsetapp.\n\nÖstgötaleden är markerad med orange färg. De delar som ingår rundslingan runt Rängen är dessutom markerade med RR.\n\n'
                    , E'#7f532a'
