EXECUTE insert_trail( E'Östgötaleden Bjärka-Säby - Sätravallen'
                    , E'Denna etapp av Östgötaleden går från Bjärka-Säby till Sätravallen. Leden är medelsvår och går på stigar och mindre vägar genom ett omväxlande landskap med ekhagar, åkrar, barrskog och små sjöar.\n\nStrax söder om Bjärka-Säby passerar etappen den välhävdade slåtterängen Bjärka-Säby ekäng. Någon kilometer senare går leden genom naturreservatet Säby Västerskog med sin urskogsliknande barrskog. Här finns bland annat en rastplats med eldstad. Ungefär halvvägs längs etappen passerar leden sjön Stora Mörken. Här finns ett vindskydd med eldstad och torrtoalett. Vid Sätravallen där etappen slutar finns ytterligare ett vindskydd med eldstad. Här finns även ett naturreservat med äldre lövskog.\n\nEtappen är en del av Östgötaledens 45 kilometer långa rundslinga runt sjön Rängen. Rundslingan är markerad med orange färg och symbolen RR. Längs leden finns bland annat sju badplatser, fyra vindskydd, tre kaféer, tre hotell/vandrarhem, en golfbana, tre kapell, två hembygdsgårdar och tre glasskiosker. Läs mer på [föreningen Rängen Runts webbplats](https://rangenrunt.se/).\n\n'
                    , E'#7f532a'
