EXECUTE insert_trail( E'Östgötaleden Sätravallen - Brokind'
                    , E'Denna etapp av Östgötaleden går från Sätravallen till Brokind. Leden är huvudsakligen lättvandrad och går genom ett omväxlande landskap med löv- och barrskogar, åkrar och hagmarker. Längs etappen passerar du bland annat Sätravallens och Brokinds naturreservat.\n\nEtappens första del ingår i Östgötaledens 45 kilometer långa rundslinga runt sjön Rängen. Väljer du att gå rundslingan viker du av västerut från huvudleden knappt två kilometer efter Sätravallen. Rundslingan är markerad med orange färg och symbolen RR. Längs rundslingan finns bland annat sju badplatser, fyra vindskydd, tre kaféer, tre hotell/vandrarhem, en golfbana, tre kapell, två hembygdsgårdar och tre glasskiosker. Läs mer på [föreningen Rängen Runts webbplats](https://rangenrunt.se/).\n\nVäljer du att fortsätta på huvudleden mot Brokind kommer du snart till ytterligare ett stigskäl. Här kan du välja att gå österut mot Mormorsgruvan och Åtvidaberg. Väljer du att fortsätta huvudleden söderut har du två kilometers vandring till ytterligare ett stigskäl. Här kan du välja att gå västerut mot Brokind och Viggeby eller söderut mot Rimforsa. Följer du leden mot Rimforsa några hundra meter ner mot Nedre Långsjön hittar du ett vindskydd.\n\nÖstgötaleden är markerad med orange färg. De delar som ingår rundslingan runt Rängen är dessutom markerade med RR.\n\n'
