EXECUTE insert_trail( E'Östgötaleden Brokind - Viggeby'
                    , E'Denna etapp av Östgötaleden går från Brokind till Viggeby. Den lättvandrade sträckan utgår från korsningen vid väg 34 och följer småvägar västerut. Leden passerar de inbjudande ekhagarna i Brokinds naturreservat, Brokinds sluss och den slottsliknande kulturmiljön vid Brokinds herrgård. Därefter fortsätter leden in i Viggeby naturreservat och ut på den vackra Jaktstugeudden.\n\nI Viggeby naturreservat finns badplatser, rastplatser och vindskydd. Dessutom finns det en vandringsled som tar dig runt i reservatet. Vandringsleden följer delvis samma sträckning som Östgötaleden, men är blåmarkerad. Östgötaleden är markerad med orange färg.\n\n'
                    , E'#7f532a'
