EXECUTE insert_trail( E'Östgötaleden Ulrika - Malexander'
                    , E'Den här etappen av Östgötaleden går från Ulrika till Malexander. Leden går genom ett vackert och småkuperat barrskogslandskap. Den följer småvägar och stigar och är oftast enkel att gå.\n\nI Ulrika, där etappen börjar, finns busstation, butik och café. Från starten vid hembygdsgården Källeryd har du lite mer än en kilometer att gå innan du är framme i det vackra naturreservatet Ycke urskog. Här finns en rundslinga genom den dramatiska urskogsmiljön och två fina rastplatser. Vid den östra rastplatsen finns även eldstad, vindskydd och torrdass.\n\nNär du passerat Ycke når du så småningom Naregöl. Härifrån följer leden den gamla kyrkstigen mot Malexander. Efter några kilometer passerar du Månhults naturreservat. Ta dig gärna tid att upptäcka det lövrika reservatet, men passa dig för Gastakullens spöken! Kanske hittar du skrevan vid bergkullen i reservatets norra del? Det sägs att dödsdömda drogs genom den trånga bergskrevan innan de hängdes på galgbacken i skrevans närhet.\n\nEfter ytterligare några kilometer kommer du till ett stigskäl. Väljer du den västra stigen har du en halvmil kvar till Malexander. Den östra stigen går mot Smedstorp och vidare mot Östgötaledens södra delar kring Österbymo och Kisa.\n\nUtöver vindskyddet vid Ycke urskog finns ytterligare två vindskydd längs etappen. Det första ligger i närheten av Axsjön och ungefär en halvmil väster om Ulrika. Du hittar vindskyddet genom att följa den markerade stigen från leden straxt söder om Lilla Farsbo. Det andra vindskyddet ligger vid sjön Svarten en kort vandring norr om Malexander.\n\nI Malexander finns affär, café och restaurang. Hotell Sommarhagen ligger vid leden norr om Malexander.\n\nÖstgötaleden är markerad med orange färg.\n\n'
                    , E'#7f532a'
