EXECUTE insert_trail( E'Skridsko på Svängbågen'
                    , E'Under gynnsamma förhållanden plogas en bana på cirka 15 till 22 klilometer. Banan går från parkeringen vid Katrineholmsvägen i sydost och sträcker sig utefter hela sjön, nästan ända fram till torpet Sjökullen i sydost. \n\nPå udden väster om Björkvik finns en eldstad.\n\nPå grund av fortsatta corona-restriktioner kommer Tjalvestugan inte hållas öppen säsongen 2021.'
