EXECUTE insert_trail( E'Hälsans Stig - Norrtälje'
                    , E'Norrtälje stad har många vackra strövområden och\nrogivande miljöer och på Hälsans Stig passerar du\nnågra av dem.\nDu möts av liv från innerstaden, kyrkklockornas slag och\nfågelkvitter samtidigt som ån porlar i bakgrunden. Stråket\nkring ån kantas av äldre bebyggelse och i det lummiga området kring Faktoribron erbjuds sittmöjligheter. Vid stigen finns också flera mysiga caféer. Hälsans Stig leder dig också till Norrtäljes största park, Socitetsparken.'
