EXECUTE insert_trail( E'Kulturpromenad Nyckelviken'
                    , E'Följ med på en promenad genom parkmiljöer, trolska skogsmarker, förbi historiska byggnader och urgamla ekar! Mäktiga utsikter över inloppet till Stockholm och stora delar av både huvudstaden och Nacka ingår. Du passerar ordnade rastplatser för picknick. Sommartid kan du titta in på caféet vid Stora Nyckelviken. Det är nära till Nyckelviken från Nacka Forum, Jarlaberg eller Ektorps centrum, men när du väl är här befinner du dig i en helt annan värld.\n\nPromenaden är cirka 3,5 kilometer. Terrängen är varierad med några branta backar. Kulturpromenaden är inte markerad i naturen, men det är lätt att hitta med hjälp av appens karta. Eller hämta den länkade foldern, där intressanta platser i Nyckelviken är markerade.'
