                    , ARRAY[ 'LINESTRING (18.179691 59.318006, 18.180034 59.317732, 18.179712 59.317207, 18.182266 59.317043, 18.186321 59.318302, 18.185656 59.320021, 18.186064 59.320524, 18.187029 59.321083, 18.187823 59.321554, 18.188403 59.321816, 18.190463 59.322232, 18.190312 59.322572, 18.191879 59.323820, 18.191192 59.324630, 18.185978 59.324586, 18.185914 59.324203, 18.187630 59.323426, 18.183167 59.323174, 18.183274 59.322747, 18.181386 59.322769, 18.179476 59.322199, 18.179283 59.321696, 18.179433 59.321324, 18.176472 59.320590, 18.176215 59.320240, 18.176429 59.319692, 18.178039 59.318291, 18.179661 59.318026, 18.179712 59.318017)']::geography[]);

