                    , E'Stigen runt Rödbergsudde är tillgänglighetsanpassad. Stigen går mellan Småbåtshamnen och Motalabron och följer man sedan cykelbanan har man en kort rundslinga. Vid stigen ligger en grillplats, även den tillgänglighetsanpassad.'
