EXECUTE insert_trail( E'Stångåns och Kinda kanals kanotled'
                    , E'Stångåns vattensystem är kanske länets bästa paddelvatten. Du kan starta långt uppströms Vimmerby och paddla hela vägen ner till Roxen. Här beskrivs paddelledens nedre delar, från Rimforsa till Roxen. Sträckan är lite drygt fem mil lång och går genom Kinda kanal och sjöarna Järnlunden, Stora och Lilla Rängen och Ärlången. Du passerar bland annat naturreservaten Hackelboö, Viggeby, Brokind och Sturefors och de vackra kulturmiljöerna vid Brokinds, Bjärka Säby och Sturefors slott.\n\nLängs paddelleden passerar du nio slussar där du måste lyfta förbi kanoten, så en kanotvagn underlättar. Lyften är korta, det längsta drygt 400 meter, flertalet omkring 100 meter. Kanotbryggor finns vid alla lyften.\n\n'
