                    , E'I Västanvik går Östgötaleden i en skärgårdsliknande miljö precis vid Vättern. Leden som är 10 km lång följer mestadels stigar längs Vätterns strand bland gamla tallar med fantastiska utblickar över Vättern. Delar av leden går man genom en sumpskog på spångad led samt bredvid fårhagar och en våtmark. Mindre sträckor går leden på småvägar nära tätorten. Flera delar av leden går tomtnära. Leden har ett fågeltorn och ett nybyggt vindskydd. Jämt spritt längs rundslingan finns det badplatser och grillplatser med fina utblickar över Vättern. Det finns också torrdass vid två av Västanviks hamnar, öppna från våren till slutet av oktober. Till grillplatserna bör man ta med sig egen grillkol. Leden går på flera ställen över lite brantare berg och klippor och är därför inte anpassad för funktionshindrade och barnvagnar. På flera platser längs leden finns det bänkar och ibland även bord för den som vill ta sig en fikapaus.\n\nLeden passerar nära en stensättning från brons/järnåldern i nordvästra kanten av udden. Det finns också en hällkista och en hålväg nära busshållplatsen Åtorpsvägen, samt flera torplämningar.\n\nVästanviks samfällighetsförening äger marken, inklusive den skyddsvärda gamla tallskogen, längs hela leden och det är de boende i området som sköter leden och alla friluftsanläggningar. Markägaren undanber sig cykling på leden.'
                    , E'#7f532a'
