EXECUTE insert_trail( E'Birgittavandringen - 9 km'
                    , E'Det finns två pilgrimsleder i Upplands Väsby kommun – Birgittavandringen och Ingegerdsleden. Att vandra längs lederna ger möjlighet till rekreation och upplevelser. De passar för såväl pilgrimer som barnfamiljer och dig som vill ta en längre promenad.\n\nBirgittavandringen är en kortare led på nio kilometer i östra delen av kommunen. Lämplig startplats är Fresta kyrka.\n\nBirgittavandringen har fått sitt namn av den heliga Birgitta av Vadstena och pilgrimsvägen knyter ihop delar av den heliga Birgittas liv, i dåtid och nutid. Vandringen går genom vackra naturområden längs Frestaån, till Sandakärret och längs med järnåldersgravarna över Sanda ängar.\n\nVandringsleden har skapats i ett samarbete mellan Upplands Väsby kommun och Fresta kyrka. År 2012 upptäcktes att Heliga Birgitta troligen föddes och växte upp på Sköldnora gård i Fresta församling år 1303.\n\n[Information om Birgittavandringen på Svenska kyrkan Fresta församlings webbplats](https://www.svenskakyrkan.se/fresta/birgittavandringen)\n\n[Information om natur- och kulturvärden längs Birgittavandringen på Svenska kyrkan Fresta församlings webbplats](https://www.svenskakyrkan.se/fresta/natur-och-kultur)'
