EXECUTE insert_trail( E'Östgötaleden – i Borensberg'
                    , E'I Borensberg går det en slinga på Östgötaleden som är 10,7 kilometer lång. Slingan sträcker sig nästan runt hela Borensberg på den norra sidan av Motala ström. Leden går längs med Motala ström och sjön Boren, en väldigt vacker sträcka med fantastisk natur. Slingan fortsätter norrut genom bostadsområden, tills man kommer till den stora och fina Bergvalla-Hällaskogen. I Bergvalla-Hällaskogen finns det ett motionsspår, ett vindskydd och en utsiksplats på det historierika Juteberget, där man under klara dagar faktiskt kan se ända till Linköpings domkyrka! Terrängen är varierad, mestadels stig men också ställvis asfalt. Leden längs Borens strand är tillgänglighetsanpassad.\n\nLeden är även anpassad för att vara cyklingsbar. En mountainbike är kanske att föredra men "vanlig" cykel har testats och det går också bra. Dock kanske man får dra cykeln vissa korta sträckor.\n\n'
