EXECUTE insert_trail( E'Hälsans Stig - Söderköping'
                    , E'Underlaget längs denna promenadvänliga slinga är asfalt, stenläggning eller hårdgjord grusyta och stigen saknar nästan helt backar. Under vandringen via den medeltida stadens gator och gränder passerar du många sevärdheter. Rådhuset är byggt 1777 men vilar på grunden från det allra äldsta rådhuset från 1200-talets första hälft. stigen går förbi Göta kanal med dess magasin, slussar och slussvaktarstugor. Den högtidliga invigningen av det 19 mil långa byggnadsverket skedde 1832 i Mem utanför Söderköping.'
