EXECUTE insert_trail( E'Östgötaleden – Medevi - Godegård'
                    , E'Leden går genom variationsrik natur, allt från öppna fält, olika typer av skogsmark och även en mosse. En del av Fläde mossar ska passeras, en sträcka på 700 meter. Den är svår att cykla genom men det finns en alternativ väg att använda istället. Strax intill Fläde mossar ligger Flädemo naturreservat som hyser flera rödlistade mossor och svampar samt regionalt rödlistade lavar. WC finns i Medevi respektive klubbhuset Krassbäck bakom uthus.\nMedevi brunn har mycket att erbjuda även för naturintresserade. Den kulturhistoriskt rika brunnsmiljön kompletteras av en biologisk rik lövträdsmiljö. I brunnsparken står bland annat Östergötlands grövsta al med den imponerande omkretsen 454 cm. I parken finns stora mängder fladdermöss, bland annat dvärgfladdermus och nordisk fladdermus. Parken är tillgängliga för rullstolar och barnvagnar. Man kan parkera bil och även bo och äta på Medevi Brunn.\n\nKrassbäck är föreningen Godegårds SK:s klubbstuga. Här finns en stor parkeringsplats (gratis). Klubbstugan fungerar som rastplats och värmestuga på vintern. Här finns fler motionsspår. Se mer information på deras hemsida www.godegardssk.se Tar man sig upp en bit på norra delen av gärdet vid klubbstugan får man en fin utsikt söderöver.'
