EXECUTE insert_trail( E'Östgötaleden – Rundslinga i Tjällmoskogarna'
                    , E'Denna rundslinga går igenom Tjällmos barrskogar på stigar, motionsspår och vägar. Lämplig start är Hagstugan där finns parkering och bänkbord. Leden är drygt 2 mil lång med det finns en genväg om man vill gå en kortare rundslinga på 1 mil istället. Längs den västra sträckan går man på berg och genom kärr. Fram mot Tikhyttesjön går man på en höjd som ger en bra utsikt över sjön som man kommer närmare och närmare. Vidare går man på spänger genom myrmark med öppna vidder och senvuxna tallar. I norr går man en bit på landsväg och kommer senare fram till Skönnarboleden. Leden går kort jämsides med Skönnarboleden för att sedan svänga av söderut. Här går leden delvis på grusvägar och kort på asfalterad väg för att sedan gå över till stigar igen. Man går förbi Perkils kättil, en jättegryta, och genom en vacker bokskog när man börjar närma sig hagstugan igen.\n\nLeden är mycket nära Tjällmo där man kan köpa och äta mat samt övernatta. En bra plats att utgå från.\n\nOBSERVERA! Delar av den tidigare sträckan mellan Västersjön och St. Svartgölen trafikeras under 2021 och 2022 av trafik till byggen av vindkraftsverk. Det är därför olämpligt att vandra denna sträcka under perioden. En ny sträcka har nu dragits. Den är inte markerad eller röjd än, men är däremot snitslad och lätt att följa redan nu. Leden här på naturkartan gäller för den nya sträckan.\n\n'
                    , E'#7f532a'
