EXECUTE insert_trail( E'Jursla MTB-led'
                    , E'Mountainbikeleden är 18 km lång och går längs skogsstigar genom kuperad kolmårdsterräng med öppna berghällar. Leden innehåller bitvis mer tekniska partier. \n\nEn garanterad naturupplevelse utlovas då du susar fram genom naturreservaten Jursla gammelskog och Lunnsjön.  \n\nLeden startar vid Lillsjön och är märkt med svart cykel på vit bakgrund.'
