EXECUTE insert_trail( E'Hälsans Stig - Storfors'
                    , E'Hälsans Stig ger möjligheter till en aktiv fritid. Den löper\ngenom centrum, men också längs Mögsjön samt förbi badplats och\ncamping vid Badsta. Mögsjön ingår i det 65 kilometer långa sjösystemet Bergslagskanalen\nsom bjuder på sex slussar, 16 sjöar, fyra älvar och fem kanaler.\nUnder vandringen passeras Kroppaskolan och Vargbroskolan som har stor\ndel i att Storfors utnämndes till Sveriges bästa skolkommun av SKL, Sveriges\nkommuner och landsting.'
