EXECUTE insert_trail( E'Danderyd-Karby gård, Roslagsleden etapp 1'
                    , E'Du ansluter enkelt till Roslagsleden från Mörby centrum, genom att gå från tunnelbanestationen ner till starten vid Rinkebyskogen. Från starten intill Danderyds kyrka, med anor från 1400-talet, går Roslagsleden genom Rinkebyskogen (naturreservat) där man kan passa på att besöka Enebybergs IP där det finns dusch/toalett/bastu gratis. Sedan går leden fram till Rösjön, vid Rösjöbadet finns åretruntöppen camping med stugor, servering, dusch med mera.\n\nDärefter följer en ganska lätt vandring genom Rösjöns friluftsområde. Från Edsvikens norra ände upp till Hagby gård i Täby, går Roslagsleden längs med en av de gamla vikingavägarna. Runt Hagby gård finns bland annat gravfält från järnåldern och runstenar från 1000-talet.\n\nEfter Hagby gård följer en vacker vandring längs Vallentunasjöns södra strand. Vid slutmålet för etappen, Karby gård, finns ett konstcentrum med bland annat konsthantverksbod. Karby gård har bussförbindelse och gångavstånd till Roslagsbanan.'
