EXECUTE insert_trail( E'Upplevelsestråket - Hammarby - 2,7 km'
                    , E'Med Upplevelsestråket kommer du nära naturen och upplevelserna i kommunen på ett enkelt sätt. Stråket sträcker sig utmed de gamla vattenlederna mellan Saltsjön och Mälaren, som användes för transporter redan på vikingatiden.\n\nStråket är uppdelat i tolv etapper och har en total längd av drygt 40 kilometer.\n\nEtappen Hammarby slingrar sig här genom ett fagert ängslandskap. Vid Stockholmsvägen ligger Hammarby kyrka som härstammar från 1200-talet. Hammarby är en av de tre ursprungliga socknar som idag utgör Upplands Väsby kommun. Ett flertal runstenar finns här samt en serie dammar för rening av dagvatten i kretslopp med\nnaturen.\n\nUpplevelsestråket är ett samarbetsprojekt mellan Upplands Väsby kommun, föreningslivet och markägarna.\n\nI kartguiden hittar du information om Upplevelsestråkets etapper och sevärdheter.'
