EXECUTE insert_trail( E'Runbyspåret'
                    , E'Elljusspår med hinderbana beläget i vackra Runbyskogen i västra Upplands Väsby.\n\nLängd: Med backe 2,9 km, utan backe 2,1 km\n\nMärkning: röd/vit\n\nKaraktär: Måttlig kupering med en lång backe.\n\nRunbyspåret kan kombineras med Kairospåret.\n\nDelar av spåret prepareras för skidåkning vintertid.\n\nUtegym finns i anslutning till spåret.\n\n\n**Testa hinderbanan!**\n\nVågar du utmana dig själv i Väsbys OCR-bana? Hinderbanan hittar du vid Runbyspåret. Den består av elva hinder med olika svårighetsgrad.\n\n[Information om hinderbanan och instruktionsfilmer på Upplands Väsby kommuns webbplats.](http://www.upplandsvasby.se/hinderbana)'
