EXECUTE insert_trail( E'Upplandsleden, Upplands Väsby'
                    , E'Om du vill utforska naturen i Harva eller på Runshalvön i västra Upplands Väsby ska du vandra Upplandsleden. Leden erbjuder utmärkta möjligheter till vandring utmed Mälarens stränder. Leden löper mellan Barkarby och fortsätter till Uppsala.\n\nLängs med Upplandsleden i Upplands Väsby finns det flera eldplatser utmed Mälarens stränder, bland annat vid Roparudden och i Sättra Gårds naturreservat. Där du kan stanna till för att grilla, fiska eller bada. Om du befinner dig på leden i de norra delarna av Runsahalvön kan du göra en avstickare till fornborgen i Runsa och se på den vackra utsikten över Mälarfjärden Skarven. Vid Runsa finns också en av Sveriges största skeppssättningar som är hela 55 meter lång.\n\n'
                    , E'#7f532a'
