EXECUTE insert_trail( E'Vandringsleden Blå leden'
                    , E'Blå leden är en vandringsled som erbjuder 35 kilometer fantastiskt kulturlandskap. Den ansluter dessutom till Roslagsleden om du vill variera eller utöka din vandring. Blå leden går från hamnen i Vaxholm, via Bogesundslandet till Domarudden i Österåkers kommun. Blå leden knyts samman med Roslagsleden vid Löttinge i Täby.\n\nDelar av blå leden är anvisad cykelstig för mountainbike.'
