EXECUTE insert_trail( E'Hälsans Stig - Hallsberg'
                    , E'Här kan du ta en skön promenad runt Ekoparken och med hjälp av kilometerskyltarna ha koll på hur långt du går. Hälsans stig är tillgänglig för alla eftersom den går längs asfalt och grus vägar och saknar branta backar och trappor.\n\nAlléhallen är en trevlig och välutrustad badanläggning\nsom ligger intill idrottsområdet. Här finns motionsbassänger, undervisningsbassäng\noch ett härligt lekland för de minsta. Hoppa i från 1 eller 3 meter eller varför inte\nkasta dig ut i den 50 meter långa vattenrutschbanan. Det finns också en utomhuspool, hinderbana, gym, bastu och café. Sommartid kan du njuta på soldäcket eller kasta ut handduken på en av gräsytorna.\n\nHinderbana – en rolig utmaning utomhus Den vackert belägna hinderbanan finner du i närheten av Ekoparken. Här tränar du både styrka och kondition. Hela kroppen får sitt när du hoppar, kryper och klättrar. Vill du öka konditionsinslaget kan du springa 200 meter mellan varje hinder. Tanken är att alla ska kunna använda banan, såväl elit som motionärer.\n\nLekplats – mitt i lummiga Ekoparken\nStrax intill Långängskolan finns en stor och fin lekplats med linbana, rutschkana, klätterställning,kompisgunga och annat skoj.'
