EXECUTE insert_trail( E'Törnskogens sagostig'
                    , E'**Törnskogens sagostig är ett spännande litet naturäventyr! Gå längs stigen med och hitta stationerna, som bjuder in till lek, motorikträning och kunskap om naturen.**\n\nFölj med vildbiet Bibbi och fladdermusen Fladde som bor i en tall med röd dörr i Törnskogen. De leker kurragömma med sin kompis Rävis. Rävis är en riktig lurifax som är jättebra på att gömma sig. Vill du hjälpa Bibbi och Fladde att hitta Rävis?\n\nSagostigen är cirka 800 m lång och består av tio stationer med skyltar. Följ markeringarna och stanna vid skyltarna där det finns olika uppgifter att utmana sig med. Sagostigen är en naturstig och lämpar sig inte för barnvagnar eller rullstolar.\n\nI direkt anslutning till stigen finns parkering samt rastplats med eldstad och vindskydd.'
