EXECUTE insert_trail( E'Axamo-IKHP - Tour De JKPG'
                    , E'Den här episka löpsträckan binder ihop de flesta av Jönköpings tätortsnära motionsområden samt passerar genom väldigt mycket av den natur som ligger närmast centrala Jönköping och Huskvarna. Vill du verkligen uppleva naturen i och runt Jönköping så ska du springa den här sträckan! Du startar vid Axamo motionsanläggning och springer sedan via Hallby, Dunkehallaleden, Stadsparken, Vattenledningsparken, en bit på Tabergs-å-leden sen genom Ljungarum till Strömsberg och Skinnersdal till Bondberget och genom Huskvarna, Pustaleden och sen till IKHP. Givetvis behöver man inte springa hela leden men vill du ha en heldag på stigarna så passa på. Längs med vägen passerar du flera utsiktsplatser så passa på att stanna och njuta av utsikten.\n\nUppstigning: 872 höjdmeter.\n\nLeden är uppmätt med hjälp av LONA-bidrag.'
