EXECUTE insert_trail( E'Bondberget - Tätortsnära stigar'
                    , E'Den tätortsnära trailrundan på Bondberget bjuder på en hel del backar, varierad natur och vidunderlig utsikt över Jönköping och Vättern. Du startar vid skylten bakom Ekhagens IF som det står Öxnegården på och sen bär det av uppåt mot utsiktsplatsen. Turen tar dig runt på den norra sidan av Bondberget och mestadels springer du på stigar, ibland grusväg. Rundan passerar hagar fyllda med stora ekar där det ibland går kossor. På slutet av rundan viker du av strax innan utsiktsplatsen och får uppleva en av de roligaste utförslöporna på hela Bondberget innan du får springa genom sagolikt vacker bokskog och sen ta dig tillbaka till starten.\n\nUppstigning: 168 höjdmeter.\n\nLeden är uppmätt med hjälp av LONA-bidrag.'
