EXECUTE insert_trail( E'Brunstorpsleden'
                    , E'Brunstorpsleden som utgår från Brunstorp gård är en rundled där du får springa genom äppelodlingar med över 200 sorters äppelträd och sedan ta dig uppför Östra Vätterbranterna på branta backar och smala slingriga stigar. Leden är markerad med gult. \n\nPusta ut och njut av den mäktiga utsikten vid Brunstorpbergets utsiktsplats innan du springer vidare och får hålla koll på var du sätter fötterna i de branta och oerhört roliga utförslöporna tillbaka ned till Brunstorps gård. Här passerar även John Bauerleden som går från IKHP till Gränna. Johnn Bauerleden är markerad med orange.\n\nUppstigning: 188 höjdmeter.\n\nLeden är uppmätt med hjälp av LONA-bidrag.'
