EXECUTE insert_trail( E'Huskvarnaberget'
                    , E'Upptäck nya stigar på västra sidan av Huskvarnaberget! Den här traillöpningsrundan tar dig till Jönköpings två finaste utsikter och du får springa på slalomliknande utförslöpningar. Huskvarnabergets tätortsnära stigar är branta men när du tagit dig upp på berget så får du springa på magiskt vackra stigar i omväxlande natur och med milsvid utsikt. Missa inte den lite undangömda utsiktsplatsen på Talludden! Rundan startar bakom det röda huset i parken.\n\nUppstigning: 412 höjdmeter.\n\nLeden är uppmätt med hjälp av LONA-bidrag.'
