EXECUTE insert_trail( E'Strömsberg - Gula leden'
                    , E'Strömsbergs naturreservat ligger i en sluttning som bjuder på vacker och omväxlande natur med skog, hagar och bäckraviner. Här finns två markerade leder, Gula leden och Röda leden, 5,6 km respektive 3,4 km. Leden är ganska kuperad och mestadels springer man på små, härligt slingrande stigar. Utmed stigarna passerar du uråldriga träd och här och där finns informationsskyltar om Strömsberg. Genom naturreservatet går också Södra Vätterleden som är markerad med orange.\n\nUppstigning: 157 höjdmeter\n\nLeden är uppmätt med hjälp av LONA-bidrag.'
                    , E'#7f532a'
