EXECUTE insert_trail( E'Vattenledningsparken - Tätortsnära stigar'
                    , E'Med citypulsen bara några meter bort men ändå med en känsla av att vara mitt ute i naturen. Vattenledningsparken bjuder på mysig traillöpning med både breda, lättillgängliga grusvägar och slingrande, smala stigar. Som vanligt i Jönköping så finns det en och annan backe när du springer runt och utsiktsplatser med fantastiska vyer över staden. Starten på rundan är vid parkeringen vid fontänerna.\n\nUppstigning: 144 höjdmeter.\n\nLeden är uppmätt med hjälp av LONA-bidrag.'
