EXECUTE insert_trail( E'Strömsberg - Röda leden'
                    , E'Strömsbergs naturreservat ligger i en sluttning som bjuder på vacker och omväxlande natur med skog, hagar och bäckraviner. Här finns två markerade leder, Gula leden och Röda leden, 5,6 km respektive 3,4 km. Leden är ganska kuperad och mestadels springer man på små, härligt slingrande stigar. Här och där finns informationsskyltar om Strömsberg. Röda leden går också genom den underbara bokskogen som finns i naturreservatet. Genom naturreservatet går också Södra Vätterleden som är markerad med orange.\n\nUppstigning: 95 meter.\n\nLeden är uppmätt med hjälp av LONA-bidrag.'
