EXECUTE insert_trail( E'Östgötaleden - Övralid runt'
                    , E'Övralid var författaren Verner von Heidenstams (1859-1940) nationalskalden och nobelpristagarens sista hem. Det klassiskt stilrena huset byggdes efter författarens egna ritningar i sluttningen ovanför Vätterns strand. 1925 kunde han flytta in i det nya huset som idag är bevarat såsom han lämnade det då han avled 1940. Under sommarhalvåret är Övralid öppet för besökare. Här finns café, parkeringsplats, rastplats, toalett.\n\nÖvralid har en hisnande milsvid utsikt över Vättern. Under sommarsäsongen sker visningar av huset varje timme och våra duktiga guider berättar även om Heidenstams liv och verk.\n\nFör den som vill lära känna Heidenstams miljö räcker det inte med att besöka hans bostad och gravplats, det är minst lika intressant att själv vandra de stigar vår store diktare trampat och njuta av den rika flora och fågelsång han skattade så högt.\n\nRundslingan är ca 2,4 km lång och löper genom varierande terrängtyper. Vid lugn promenadtakt tar det knappt 1 timme att gå stigen.'
                    , E'#7f532a'
                    , ARRAY[ 'LINESTRING (14.936955 58.604018, 14.936950 58.604018)'
                           , 'LINESTRING (14.936955 58.604018, 14.936992 58.604040, 14.936989 58.604377, 14.937075 58.604687, 14.936839 58.605052, 14.936891 58.605720, 14.936862 58.605893, 14.937223 58.606243, 14.937194 58.606629, 14.937991 58.607266, 14.938585 58.607268, 14.939046 58.607286, 14.939385 58.607307, 14.939495 58.607519, 14.939636 58.607791, 14.939927 58.608057, 14.940266 58.608543, 14.940170 58.608805, 14.940146 58.609049, 14.940259 58.609246, 14.940522 58.609244, 14.941363 58.609119, 14.941474 58.608978, 14.941475 58.608667, 14.941704 58.608560, 14.942241 58.608786, 14.942239 58.608995, 14.942369 58.609191, 14.942539 58.609435, 14.942640 58.609514, 14.942719 58.609598, 14.943282 58.609484, 14.943527 58.609222, 14.943865 58.609003, 14.944267 58.608896, 14.944558 58.608741, 14.944678 58.608671, 14.944857 58.608616, 14.944870 58.608560, 14.943726 58.607630, 14.943356 58.606854, 14.943592 58.606578, 14.943276 58.605497, 14.942849 58.604174, 14.942850 58.603350, 14.942219 58.603000, 14.941698 58.602876, 14.941201 58.602594, 14.940875 58.602455, 14.940321 58.602400, 14.940072 58.602381, 14.939658 58.602500, 14.938624 58.602565, 14.937205 58.602832, 14.936632 58.602860, 14.935673 58.603273, 14.936955 58.604018)']::geography[]);

EXECUTE insert_trail( E'Angereds kyrka - Fontin, Bohusleden, etapp 6'
                    , E'Från jordbruksmarkerna kring Angered bär det av uppåt. Du passerar Lärjeån och når Rannebergen och Vättlefjäll. »Vättle« hänger samman med ord som vatten och väta – och här är det gott om både våtmarker och sjöar.\n\nLeden går genom Bohus lilla samhälle och vidare över Göta Älv på  Jordfallsbron. Bohusbron leder vidare till Fästningsholmen, med ruinen av Bohus Fästning som tronar genom århundradena.\n\nStanna gärna till och njut av atmosfären och miljöerna nere i Kungälvs centrum innan du tar den vackra, men ganska envisa, uppförsbacken till Fontin. \n\nhttp://bohusleden.se/ledens-strackning/ledens-strackning/etapp-6-angereds-kyrka-fontin.html'
