EXECUTE insert_trail( E'Jonsered-Angereds kyrka, Bohusleden, etapp 5'
                    , E'Den femte etappen bjuder på bokskogspromenad i Bokedalens naturreservat. Under våren är det sagolikt vackert här, när marken täcks av ett hav av vitsippor.\n\nVid Jonsereds herrgård delar sig leden i två olika sträckningar som möts igen uppe vid torpet Freden. Landvägen, genom ravinlandskapet, ger en kortare promenad på cirka 20 minuter.\n\nDen andra sträckningen följer Aspens strand. Här går du i den trolska gammelskogen. Efter runt 45 minuters vandring är du framme vid torpet.\n\nHärifrån fortsätter leden norrut, över en hängbro mellan Stora och Lilla Ramsjön, mot Angered.'
                    , E'#7f532a'
