EXECUTE insert_trail( E'Hälsans Stig - Vallentuna'
                    , E'Hälsans stig är en tillgänglig slinga med ett plant, hårt underlag så att det är möjligt att ta sig fram såväl till fots som med rullstol och rullator. Varje kilometer är markerad så att du enkelt ska hitta rätt och veta hur långt du har gått. Det finns flera bänkar längs vägen där du kan sätta dig ner och vila – och om du blir riktigt trött kan du alltid hoppa på en buss.\n\nStigen ligger i Ekeby i centrala Vallentuna där många människor rör sig, är belyst och snöröjs på vintern.'
