EXECUTE insert_trail( E'Järnbärarleden'
                    , E'Järnbärarleden mellan Gnosjö-Isaberg är en led på ca 17 km. Den går i omväxlande natur och terräng kännetecknande för Västra Småland.\n\nJärnbärarleden börjar i Töllstorps fritidsområde i Gnojsö, där ifrån följer du orange markering som är målad på trästolpar utmed hela sträckan. Det finns både vindskydd, eldstäder och färskvatten utmed leden. Strax före Isaberg passerar du Ettö naturreservat som är väldigt fint. På leden kan man både vandra och cykla mountainbike.\n\nKälla: vastrasmaland.se\n\n'
