EXECUTE insert_trail( E'Östgötaleden - Skönnarboleden - Kärnskogsmosse'
                    , E'Denna del av Östgötaleden går på grusvägar igenom Tyleskogens tallskogar. Den norra delen har utsikt över det stora myrkomplexet som Kärnskogsmossen är en del av. Man får också utsikt över Gällsjön där det också finns en grillplats med vedförråd. I Kärnskogsmosse finns det flera grillplatser och raststuga man kan övernatta i, en tillgänglighetsanpassad toalett och parkering.\n\n'
                    , E'#7f532a'
