EXECUTE insert_trail( E'Ryvålsrundan'
                    , E'En fin hel dagstur runt Lill- och Stor-Ryvålen gör man genom att först följa stigen som går ner mot Valmen. Stigen delar sig vid ett par tillfällen och man håller då till höger hela tiden. Efter cirka 7 km når man det vindskydd som ligger alldeles bredvid en av småtjärnarna på Stor-Ryvålen. Därifrån fort­sätter man i riktning mot fjället tills man kommer fram till den stig som leder antingen tillbaka till Nyvallen (3,5 km) eller till Nysätern. Den första delen av stigen går mest genom högvuxen och vacker gammal skog. Stigen går ibland också över magra och torra tallhedar. I några av de fuktigare sänkorna växer jungfru Marie nycklar och spindelblomster skymtar här och var i granskogen. Uppe på Stor-Ryvålen har man en fantastisk utsikt över Sonfjällsmassivets nordöstra sida. Innan man kommer fram till vindskyddet passerar man några mindre tjärnar. Stigen tillbaka till Nyvallen följer fjällkanten genom fjällbjörkskogen. Höga smörblommor och skogsnävor tävlar med tortan om att synas bäst i fjällbjörkskogens yppiga grönska.\n\n'
                    , E'#7f532a'
