EXECUTE insert_trail( E'Dalsvallen - Hästtjärn - Sododalen'
                    , E'Från Dalsvallen kan man ta sig upp mot och in i national-parken söderifrån. Följ leden mot Sododalen. Leden går först genom skog, sedan över tallhed och öppet fjäll innan man når Hästtjärn, efter ca 8 kilometers vandring. Man passerar Korpﬂyet, där björnarna gärna letar efter mat på de steniga sluttningarna på hösten. Vid Hästtjärn kan man njuta av utsikten och vila i vindskyddet innan man vänder tillbaka.\n\n'
