EXECUTE insert_trail( E'Nysätern - Sododalen'
                    , E'I Sododalen, som ligger i Sonfjällmassivets centrum, kantas ån Sodan av fjälltimotej, hässlebrodd, fjällkåpa, ängssyra, rödblära, skogsnäva, lundarv och torta. Här trivs också många fåglar, bland andra strömstare och drillsnäppa. Utgå från parkeringsplatsen nedanför Nysätern, eller vid själva Nysätern, och gå vidare upp mot Gråsidan och Sododalen\n\n(5 km). För den här turen bör man avsätta en hel dag. Den som vill kan passa på att göra en topptur upp till Högfjället. Dit är det bara 2 km från raststugan. När det bär av ner i Sododalen kan man passa på att ta sig en extra titt på den sadelskåra man då har till höger om sig. På avstånd kan man även se några av skvalrännorna i Högfjällets västra sluttning och den lilla raststugan skymta nere i dalen. Väl nere i Sodans dalgång kan man njuta både av sin medhavda matsäck och av den stillhet som inﬁnner sig i detta som man mycket väl kan kalla Sonfjällets hjärta.\n\n'
                    , E'#7f532a'
                    , ARRAY[ 'LINESTRING (13.422242 62.289287, 13.422558 62.289449, 13.423529 62.289520, 13.423868 62.289555, 13.424407 62.289810, 13.424665 62.289843, 13.425100 62.289916, 13.425432 62.290087, 13.425614 62.290323, 13.425740 62.290400, 13.426176 62.290443, 13.426986 62.290497, 13.427615 62.290565, 13.427987 62.290599, 13.428626 62.290501, 13.429544 62.290322, 13.430297 62.290217, 13.431400 62.289935, 13.431581 62.289884, 13.432185 62.289815, 13.432681 62.289654, 13.433246 62.289404, 13.433787 62.289296, 13.434489 62.289228, 13.434835 62.289126, 13.435747 62.288774, 13.436743 62.288656, 13.437628 62.288515, 13.439344 62.288300, 13.439994 62.288292, 13.440756 62.288618, 13.441740 62.288750, 13.443096 62.288902, 13.443905 62.288964, 13.444502 62.289031, 13.445012 62.289020, 13.445608 62.288989, 13.446188 62.289048, 13.446716 62.289134, 13.447220 62.289243, 13.447928 62.289324, 13.448525 62.289391, 13.449427 62.289449, 13.449902 62.289493, 13.450576 62.289486, 13.451674 62.289532, 13.452811 62.289646, 13.453699 62.289771, 13.455025 62.289950, 13.456493 62.290179, 13.457576 62.290502, 13.458455 62.290848, 13.459720 62.290878, 13.460553 62.290707, 13.463002 62.290942, 13.465881 62.291247, 13.467382 62.291332, 13.470102 62.291572, 13.472788 62.291540, 13.474173 62.291492, 13.475450 62.291471, 13.477296 62.291408, 13.480402 62.291467, 13.482593 62.291436, 13.484598 62.291308, 13.487119 62.290942, 13.489294 62.290785, 13.491111 62.290508, 13.492242 62.290360, 13.493646 62.290328, 13.494455 62.290103, 13.495374 62.290010, 13.498182 62.289079, 13.499036 62.288636, 13.499172 62.288428, 13.500681 62.288280, 13.502467 62.287907, 13.504667 62.287080, 13.507866 62.285746, 13.509112 62.285472, 13.509375 62.285005, 13.510757 62.284072, 13.511806 62.283801, 13.512015 62.283179)']::geography[]);

EXECUTE insert_trail( E'Lillfjällsleden'
                    , E'Till Lillfjället kommer man genom att följa stigen förbi infor-mationsstugan och vidare upp genom fjällbjörkskogen. Där skogen glesnar ser man »Lilltoppen« till höger, en liten bit upp i sluttningen. Uppe på Lillfjället (1010 meter över havet) har man en fantastisk utsikt över det skogs- och fjällandskapet med fäboden och de klara småtjärnarna nedanför fjället.\n\n'
                    , E'#7f532a'
