EXECUTE insert_trail( E'Nyvallen - Nysätern'
                    , E'Vill man gå till Nysätern från Nyvallen ﬁnns olika möjligheter. En trevlig vandring börjar alldeles ovanför den översta av de två stugor man passerar på vägen upp mot fjället från Nyvallen. Välj den stig som viker av åt höger och som följer fjällsluttningen västerut. Håll till vänster där stigen delar sig efter ett par kilometer. Så småningom blir fjällbjörkskogen glesare och man kommer ut på den torra fjällheden. Sedan är det bara att följa stigen tills man kommer fram till den led som följer Gråsidans västra sluttning ner till Nysätern. Man kan också välja ett lite mer ansträngande alternativ och gå via Sododalen. Då följer man leden söderut från Nyvallen mot Sododalen (totalt cirka 7 km). Vid raststugan i Sododalen väljer man sedan stigen mot Nysätern (5 km) som går upp i passet mellan Gråsidan och Valmfjället.\n\n'
