EXECUTE insert_trail( E'Reservatsled - Blå slingan (Karshult naturreservat)'
                    , E'En vacker rundslinga som går bredvid gamla stenmurar, täta vitsippsbestånd, över vattendrag och utmed äldre vägar i mäktiga pelarsalar. Rundslingan är röjd och markerad. Det går lätt att gå hela slingan.\n\nDenna slinga kopplar på den röda slingan om man vill gå en längre promenad.\n\nDet finns två rastplatser längs leden, en vid västra parkeringen och en i sydväst vid stenmuren med utsikt över sjön Boren bortanför åkrarna.\n\nNaturreservatet förvaltas av Motala kommun. Vi undanber cykling på reservatslederna. Det är på många platser en känslig mark i reservatet. Stigarna blir också väldigt lätt leriga och blöta.\n\n'
