EXECUTE insert_trail( E'Östgötaleden - Motala - Borensberg, Birgittaleden'
                    , E'Vandra i det vackra slättlandskapet och utmed Borens södra strand. Östgötaleden mellan Motala och Borensberg delar sin sträckning med Birgittaleden, en pilgrimsväg som knyter ihop delar av den heliga Birgittas liv, i dåtid och nutid.\n\nLeden börjar i vid Göta kanal vid Mallboden i Motala. Här passerar man Klockstapeln, som står på den plats där det byggdes en smedja 1810 och där Motala Verkstads historia startade. Borenshults slussar är Göta kanals brantaste slusstrappa och här slussar man i fem slussar till eller från sjön Boren.\n\nSedan går man över Göta kanal och Motala ström till slaggbacken. Här går man Sjöbo-Knäppans naturreservats fantastiska natur längs Borens strand med möjlighet till bad, grillplats och rastplatser. Vill man cykla leden så börjar man vid slaggbacken och cyklar genom odlingslandskapet förbi Sjöbo-Knäppan mot Vedemö.\n\nLeden tar dig upp till Birgittas udde. Här finns ruinerna efter den borganläggning där den heliga Birgitta levde och verkade. Här kan man njuta av av utsikten ut över Boren under lummiga lövträd.\n\nLeden går även förbi Ulvåsa slott med en slottspark ner mot vattnet som är öppen för allmänheten. Den lummiga parken som omger slottet tillsammans med det natursköna läget invid sjön Boren ger ytterligare dimensioner till Ulvåsas storhet.\n\nMan kan även göra en avstickare till Ekebybornas kyrka och ta sig till Gamla Prästgården vid Borens strand.\n\nEn stor del av leden går längs många grusvägar med utsikt över odlingslandskapet.\n\nLeden slutar i Borensberg där man kan äta och övernatta. Här finns även badmöjligheter, man går precis intill Strandbadet och slutar vid Göta kanal. Såklart kan man också börja sin vandring här i Borensberg.\n\nPå sträckan är du välkommen att vandra eller cykla på lätt framkomliga vägar. Som cyklist kan man välja att ta den rakare sträckan längs grusvägarna på slätten.\n\nDet finns goda övernattningsmöjligheter (bl.a. fem STF vandrarhem, många hotell och pensionat) och tillgång till affärer och matställen. Mer information om Birgittaleden, kartor och vägbeskrivningar finns att hitta på Pilgrimscentrums hemsida.\n\nPå Naturkartan är Birgittaleden uppdelad i fyra delsträckor. Sträckan mellan Borensberg och Motala är 27 km.\n\n'
