EXECUTE insert_trail( E'Långhundraleden - paddelled'
                    , E'Långhundraleden är vikingarnas gamla farvatten mellan Uppsala och Östersjön. Långhundraleden finns delvis kvar som vattenled även idag, även om den numera mest lämpar sig för kanotpaddling.\n\nLeden är särskilt lämplig för ungdomsgrupper då den är lätt att paddla och har fina badmöjligheter.\n\nBrotorp är den nordligaste punkten där vattendjupet oftast är tillräckligt för paddling året om. Vid Brotorp heter vattendraget Helgöån och på den paddlar du medströms med Vadadalens strandängar på bägge sidor. Strax norr om Vada kyrka, på åns västra sida, passerar med tre stora gravhögar på rad som brukar kallas för Sjökullarna och anses vara vikingatida gravar för lokala kungar. Innan ån mynnar ut i Garnsviken passerar du Össeby-Garn, som på båda sidor om ån erbjuder ett intressant stopp.\n\nEfter en dryg kilometers paddling i Garnsviken kommer du fram till Flattsta och en iordningställd rastplats på västra stranden.Här finns vindskydd, toalett, eldstad och plats att sätta upp tält.\n\nYtterligare tre kilometer söderut kommer man fram till Garnsviksbadet i Österåker kommun. Badet är bra att hålla utkik efter så att man inte missar inloppet till Åkers kanal som är det vatten som leder ner till utloppet i Trälhavet via Åkersberga slussar.\n\n'
                    , E'#7f532a'
