EXECUTE insert_trail( E'Ingaleden, Vallentuna pilgrimsleder'
                    , E'I socknarna Markim, Orkesta och Frösunda finns spår av människors liv, arbete och tro under tusen år och mer. Runstenar, gamla husgrunder och gravhögar berättar om dramatik och vardagshändelser för länge sedan. De medeltida kyrkorna längs vägen erbjuder stilla rum av tidlöshet och ro.\n\nAtt vandra som pilgrim är att vandra med alla sinnen öppna. Inga i Snåttsta, Ulf i Borresta och Livsten från Torsholma är några av de människor från 1000-talet som gått här före oss. De har fått ge namn åt lederna.\n\nInga-leden börjar vid Frösunda kyrka och Frösundagården, bara några hundra meter från Frösunda station, avslutas vid Lindholmens station. Leden går mestadels på väg farbar med rullstol och barnvagn, ett kort avsnitt går på traktorväg, som senare återknyter till landsväg.\n\n'
