EXECUTE insert_trail( E'Livstens-leden, Vallentuna pilgrimsleder'
                    , E'I socknarna Markim, Orkesta och Frösunda finns spår av människors liv, arbete och tro under tusen år och mer. Runstenar, gamla husgrunder och gravhögar berättar om dramatik och vardagshändelser för länge sedan. De medeltida kyrkorna längs vägen erbjuder stilla rum av tidlöshet och ro.\n\nAtt vandra som pilgrim är att vandra med alla sinnen öppna. Inga i Snåttsta, Ulf i Borresta och Livsten från Torsholma är några av de människor från 1000-talet som gått här före oss. De har fått ge namn åt tre pilgrimsleder i Vallentuna.\n\nDen kortaste leden är Livstens-leden som både börjar och slutar i Frösundagården. Den består av delvis mer svårforcerad terräng på slingriga stigar och traktorvägar, naturen är rik och omväxlande.\n\nLängs vägen finns på kartan Frösunda kyrka och ytterligare fem platser markerade där du kan stanna till och läsa om dessa platser eller lyssna på ljudfiler här på Naturkartan:\n\n1. Frösunda kyrka\n2. Skogsglänta med myrstack\n3. S:t Olofs källa\n4. Livstens ristning\n5. Klashagen\n6. Livstens hamn \n'
