EXECUTE insert_trail( E'Vallentuna IP motionsspår 5 km'
                    , E'Motionsspåret går genom en vacker skog och om du inte har allt för bråttom finns det stundtals gott om både svamp och bär längs med spåret.\n\nDu får gärna använda spåren för promenader med din hund. Men tänk på att hunden ska vara kopplad och att du tar med dig en påse att plocka upp hundens bajs om det behövs.'
