EXECUTE insert_trail( E'Olhamraleden'
                    , E'Olhamraleden går mellan Vallentuna Centrum (Pressbyrån) via Vallentuna IP till Olhamra och entrén till Angarnsjöängens naturreservat. Den är cirka 4 kilometer och innehåller många intressanta natur- och kulturområden som under 2021 kommer att skyltas. Exempelvis går den genom en urskogsliknande naturskog, vackra hällmarker samt träskliknande våtmarker.\n\nEftersom leden varierar topografiskt och går över "stock och sten", har vi klassat leden som medelsvår (lätt-medelsvår-svår).\n\nMarkeringen av leden kommer att förbättras nu under 2020.\n\nVänligen uppmärksamma att det inte är tillåtet att köra motorcykel eller rida i leden eller i naturreservatet Angarnsjöängen.'
