EXECUTE insert_trail( E'Tillgänglighetsslingan, Mörbytorp'
                    , E'Från Lindholmens station följer du Trädgårdsvägen tills du kommer till Lindholmsvägen, följ den ca 600 meter. På höger sida är det en skyld där det står Mörbytorp, åk in på den vägen. \n\nOmrådet är idylliskt med röda stugor med vita knopar och har anor från 1600-talet. Efter att du passerat stora åkerfält kommer du efter ca 1 km till en korsning, där svänger du höger och fortsätter vägen in i skogen. Efter ytterligare 700 meter kommer du till ytterligare en t-korsning, där svänger du höger och fortsätter Vasalundsvägen. \n\nEfter 1 km passerar du en å som går under en bro, fortsätt vidare tills nästa vägkorsning. Sväng där vänster och fortsätt Bygdevägen upp för en liten backe som går genom ett villaområde. Vid nästa t-korsning svänger du vänster för att efter ca 10 meter svänga höger för att fortsätta den tills du kommer tillbaka till Lindholmens station.'
                    , E'#7f532a'
                    , ARRAY[ 'LINESTRING (18.106566 59.587573, 18.106051 59.586900, 18.105579 59.585792, 18.105107 59.584553, 18.104131 59.582951, 18.108669 59.583445, 18.112403 59.584032, 18.112274 59.584206, 18.114806 59.585466, 18.115149 59.586118, 18.114806 59.586682, 18.114806 59.587247, 18.118497 59.588399, 18.122788 59.588703, 18.124762 59.589528, 18.129183 59.591244, 18.130556 59.591787, 18.131457 59.592222, 18.132230 59.592374, 18.132230 59.592917, 18.130084 59.594046, 18.127509 59.593634, 18.127380 59.593199, 18.126822 59.592895, 18.126050 59.592439, 18.125406 59.592439, 18.124290 59.592982, 18.122359 59.592613, 18.121157 59.592309, 18.119312 59.592483, 18.116866 59.592439, 18.115278 59.592569, 18.114034 59.592569, 18.113561 59.591809, 18.112574 59.591288, 18.111158 59.590006, 18.109570 59.589528, 18.107682 59.589528, 18.107296 59.589485, 18.106566 59.587573)']::geography[]);

EXECUTE insert_trail( E'Tillgänglighetsslingan - Granbyrundan'
                    , E'Den här slingan bjuder både på en fin natur och intressant historia där det går att ta sig fram med rullstol eller rullator. Från Lindholmens station åker man Trädgårdsgatan ut till Lindholmsvägen för att där svänga höger. Följ cykelvägen bort till Ica-butiken där cykelvägen för tillfället tar slut. Efter några hundra meter fortsätter cykelvägen, fast på den högra sidan av vägen, fortsätt den till du kommer till en skyld där det står Granby, sväng in på grusvägen och fortsätt den.\n\nEfter några hundra meter kommer man fram till ett cafe, Hökeriet, där man kan stanna till för en fika om man vill. De har inte öppet varje dag så kolla deras hemsida först. Här finns även en anpassad toalett. Man kommer dock inte in med en större elrullstol eller permobil.\n\nFortsätt grusvägen ett par kilometer tills du kommer till Markimvägen, sväng där höger och fortsätt den, men var försiktig pga biltrafiken. Efter knappt 1 km, sväng höger och fortsätt Lindholmsvägen söderut tills du kommer till Lindholmens station igen.'
                    , E'#7f532a'
                    , ARRAY[ 'LINESTRING (18.108315 59.584178, 18.105225 59.584417, 18.107543 59.589305, 18.107543 59.590044, 18.106770 59.591477, 18.103981 59.594041, 18.102650 59.594627, 18.102221 59.594627, 18.099346 59.594236, 18.098058 59.593997, 18.095612 59.594214, 18.093424 59.594779, 18.093037 59.595105, 18.093166 59.596582, 18.091922 59.597385, 18.090720 59.597516, 18.087330 59.597624, 18.086085 59.598015, 18.084240 59.598276, 18.083253 59.598428, 18.080721 59.599405, 18.084068 59.599514, 18.087544 59.600078, 18.088832 59.600448, 18.089947 59.600860, 18.093724 59.601294, 18.096857 59.601294, 18.098788 59.601555, 18.099861 59.598319, 18.100676 59.597429, 18.103723 59.596213, 18.104024 59.595604, 18.103938 59.594692, 18.104582 59.594453, 18.103938 59.594041, 18.105483 59.592824, 18.106770 59.591434, 18.107071 59.590717, 18.107586 59.590000, 18.107586 59.589262, 18.105182 59.584482, 18.108315 59.584178)']::geography[]);

EXECUTE insert_trail( E'Tillgänglighetsslingan, Markimrundan'
                    , E'Börja vid kyrkan och fortsätt Markim Kyrkväg söderut, tills du kommer till Markimvägen, sväng vänster och fortsätt vägen ca 400 meter. När du kommit upp en bit på backen har du kommit till Skrattbacken, sväng vänster och fortsätt Lundavägen norrut.\n\nOmrådet bjuder på öppna, platta landskap med minnesmärken  från forntiden.\n\nNär du kommit ca 2 km, sväng vänster och fortsätt grusvägen tills du passerat gården Lena efter ca 450 meter, håll höger och fortsätt ytterligare 200 meter, sväng vänster grusvägen bort.\n\nNär du kommit ca 1 km, sväng vänster och åk ner för backen och när du kommer till nästa lilla by som heter Ekeby svänger du vänster och fortsätter söderut. Efter ca 800 meter har du kommit till Snåttsta där det finns runstenar som man kan undersöka lite närmare, annars fortsätt söderut ytterligare 1 km tills du kommer tillbaka till Markim kyrka där promenaden började. Här finns både rastplatser och toaletter som är tillgängliga.'
                    , E'#7f532a'
                    , ARRAY[ 'LINESTRING (18.060137 59.599954, 18.057476 59.600475)'
                           , 'LINESTRING (18.050609 59.606815, 18.048721 59.607944, 18.046404 59.611331, 18.042026 59.613546, 18.040910 59.614761, 18.039709 59.614761, 18.036876 59.619015, 18.036876 59.619884, 18.040138 59.619970, 18.047605 59.622141, 18.050180 59.618842, 18.051296 59.618842, 18.051296 59.617626, 18.053442 59.617409, 18.056875 59.616758, 18.057991 59.615022, 18.066059 59.613936, 18.066059 59.613372, 18.067260 59.612590, 18.067260 59.611462, 18.067690 59.610810, 18.069320 59.611331, 18.073869 59.614457, 18.076359 59.615673, 18.079792 59.613676, 18.080049 59.612330, 18.079706 59.611592, 18.080478 59.609073, 18.082023 59.608769, 18.084598 59.609160, 18.085886 59.608813, 18.087087 59.609377, 18.097902 59.606729, 18.099275 59.606251, 18.098331 59.602994, 18.098932 59.601561, 18.096872 59.601257, 18.093611 59.601257, 18.090006 59.600909, 18.087087 59.599954, 18.080822 59.599346, 18.073526 59.599172, 18.071037 59.598781, 18.066917 59.599042, 18.064428 59.599650, 18.060137 59.599823, 18.057390 59.600345, 18.053184 59.599780, 18.050695 59.604818, 18.050609 59.606815)']::geography[]);

EXECUTE insert_trail( E'Hälsans Stig - Sorsele'
                    , E'Välkommen till Hälsans stig i Sorsele/Suorssá\nBuerestbåhtieme Varriesvuadan bálggáje Suorsáne\n\nÄventyr och upplevelser inom gångavstånd\nSorsele kommun/Suorsán tjeälddie består av tre destinationer i en och är en del av Unescos biosfärområde, VindelälvenJuhtatdahka, ett modellområde för hållbar utveckling. I den ena änden av kommunen finns den turistiska destinationen Gargnäs, en by som ligger på ett näs mellan två olika vattendrag. I den andra änden finns den pittoreska samiska fjällbyn Ammarnäs. \n\nDäremellan ligger Sorsele/Suorssá ett fridfullt litet samhälle med bykänsla, med den orörda Vindelälven rinnande längs promenadstråken och närhet till lättillgänglig natur och ett flertal utflyktsmål såsom Inlandsbanemuseet, Älvkungen, kyrkan och Hembygdsområdet m.m.\n\nInlandsbanemuseet / Museum of Inlandsbanan\nInlandsbanans museum berättar om hur järnvägen byggdes längs inlandet i början av 1900-talet. Det finns bilder, filmer och utställningar av föremål att ta del av på järnvägsstationen i Sorsele.\n\nÄlvkungen / The River King\nTurbåten Älvkungen började använda Vindelälven 1921 för att skicka post, varor, djur och mat. Idag finns den gamla båten under tak på Sorsele hembygdsområde.\n\nFriluftsmuseum / Open-air museum\nHembygdsområdet i Sorsele samlar gamla byggnader som en traditionell gårdsmiljö och ytterligare byggnader spridda runt en damm.\n\nSorsele kyrka / Sorsele church\nKyrkan i Sorsele ligger invid Vindelälvens strand och upp-fördes 1859. Under sju månader byggde sockenborna kyrkan för hand med yxa och kransåg. Idag är det en av övre Norr-lands bäst bevarade kyrkor från nyklassicismens tid.'
                    , E'#7f532a'
                    , ARRAY[ 'LINESTRING (17.526417 65.538122, 17.522490 65.539339, 17.518714 65.540654, 17.516182 65.541382, 17.514916 65.541560, 17.512126 65.541862, 17.511268 65.541516, 17.512877 65.541285, 17.514143 65.541516, 17.514679 65.541489, 17.515817 65.541347, 17.518134 65.540734, 17.516546 65.539970, 17.516525 65.539748, 17.517448 65.539126, 17.522082 65.537020)'
