EXECUTE insert_trail( E'Tillgänglighetsslingan - Björkby-Kyrkvikens naturreservat'
                    , E'Turen börjar vid Vallentuna kyrka som är en kyrka från medeltiden och fortsätter Kyrkvägen ner för en liten backe och kyrkogården på vänster sida. Strax innan utomhusbadet svänger man vänster, upp för en liten backe och följer grusvägen ner mot Vallentunasjön. När man kommer ner har man en rastplats nere vid sjön där man kan fika eller grilla.\n\nVäljer man att inte fika utan i stället fortsätta när man kommit ner till sjön svänger man vänster och fortsätter den fina, breda stigen genom skogen fram till ett fält, där håller man höger och fortsätter över en liten bro och sedan höger upp för en ganska lång asfalterad backe.\n\nNär man tagit sig upp för backen har man Bällsta station på vänster sida, där svänger man höger ner till Lagerfelts väg för att där svänga höger igen. Efter ett tiotal meter svänger man vänster och fortsätter Västra Manhemsväg en kort bit, tills man kommer till en cykelväg som går in åt vänster. Fortsätt cykelvägen ca 500 meter, tills man kommer till en vändplan och badplatsen Gustavs udde där man kan bada eller bara njuta av utsikten. Våren 2020 planerar man att anlägga en anpassad toalett.'
                    , E'#7f532a'
                    , ARRAY[ 'LINESTRING (18.074439 59.531840, 18.072809 59.532123, 18.070234 59.533124, 18.067745 59.533603, 18.066929 59.532167, 18.068732 59.531405, 18.068860 59.530796, 18.069847 59.530273, 18.071049 59.530230, 18.072723 59.529555, 18.073636 59.528696, 18.074151 59.527652, 18.072820 59.526868, 18.071705 59.526259, 18.070846 59.525149, 18.070912 59.523961, 18.071384 59.523177, 18.070869 59.522938, 18.070397 59.523526, 18.069453 59.523439, 18.069496 59.522503, 18.068594 59.522394, 18.067564 59.522154, 18.066878 59.521784, 18.066148 59.521088, 18.064861 59.520696, 18.064303 59.520565)']::geography[]);

EXECUTE insert_trail( E'Hälsans Stig - Hova'
                    , E'Här är några av platserna du passerar på din vandring:\n\nRiddarparken\nHova Riddarvecka är en uppskattad medeltida folkfest i juli sedan 1989. Riddarna är lika taggade, stadsvakterna har putsade skor och hästarna står och\ntrampar av iver. I Riddarbyn ställer knallarna upp sina stånd som dignar av mat, kläder, smycken, godis, delikatesser och annat smått och gott. Kort sagt,\nHova ger dig en riktigt härlig medeltida upplevelse i dagarna nio.\n\nTornerspelsplatsen\nPå tornerspelsplatsen får du njuta av snabba hästar och tappra riddare när de visar upp sina skickligheter i träffsäkerhet och närkamp. Tillsammans med gycklarna strävar de efter att vinna publikens hjärta och ge dig en kväll med medeltida nöjen. Show, fart och fläkt präglar våra tornerspel och vi garanterar att varje sekund blir fartfylld. Håll även ögon och öron öppna för en eldshow på tornerspelsplatsen.\n\nHantverkshuset\nVisste ni om att Hantverkshuset tidigare var en byggnad för lag och ordning? Tingshuset invigdes i Hova den 1 februari 1859. Det brann dock ner till grunden några veckor därefter men byggdes upp igen. Det dåvarande Tingshuset var placerat i Hova centrum och var i bruk fram 1924. När nybildade Hova Hantverksförening köpte huset 1943 fick den inte bara en ny funktion utan flyttades till Mon.\n\nMovallen/Getryggen\nIntill Movallen där det bland annat spelas fotboll ligger friluftsanläggningen Getryggen. En fin barrskog där du kan vandra, springa och cykla eller bara njuta av naturen. Här finns tre motionsspår, ett mountainbikespår samt rastplatser, vindskydd och ett uterum för en trevlig fika- eller grillstund.\nFolkhälsorådet är ett samverkansorgan mellan Gullspångs kommun och Västra Götalandsregionen med uppgift att initiera, utveckla och samordna resurser\nför hälsofrämjande arbete. I oktober 2019 beslutade man att anlägga Hälsans stig i Hova och Gullspång som ett led i arbetet med att nå folkhälsomålet ”30 minuter rörelse” om dagen'
                    , E'#7f532a'
                    , ARRAY[ 'LINESTRING (14.217838 58.856146, 14.214941 58.855052, 14.215928 58.854048, 14.216765 58.852822)'
