EXECUTE insert_trail( E'Hälsans Stig - Gullspång'
                    , E'Frans G Bengtssons minnesbibliotek\nDen kände författaren Frans G Bengtsson (1894- 1954) levde sina sista femton år i Gullspångs kommun. Böcker från hans privata bibliotek finns\nsamlade i ett av rummen på Gullspångs kommunbibliotek. Här finns förutom böckerna, det rustika skrivbordet och en rad intressanta originaldokument som brev och arbetsanteckningar.\n\nLaxtrappan\nGör en kort avstickare till Laxtrappan och se den unika Gullspångslaxen, en art som bara finns på två ställen i världen. Laxens lektid kan variera från\når till år, men en tumregel är att leken pågår under oktober och november. Polariserande solglasögon och tålamod kan vara bra då fiskarna inte är helt\nenkla att få syn på i det mörka vattnet.\n\nDressinparken\nFrån Dressinparken kan du från maj till september trampa dig ut och uppleva den vackra naturen längs rälsen. Välj mellan två banor, Torvedsbanan\neller Otterbäcksbanan. Packa picknickkorgen, ta med familj och vänner och njut av en härlig utflykt.\n\nKulogymmet\nEfter gediget arbete från ideella krafter invigdes Kulogymmet i juni 2019. Här finns möjlighet att utöva funktionell träning för hela kroppen och alla muskelgrupper i samband med din promenad eller löprunda.'
