EXECUTE insert_trail( E'Reservatsled - Gula slingan (Karshult naturreservat)'
                    , E'Från parkeringen går en vacker slinga på 500 m i öppen blandskog, örtrik granskog och utmed ekbrynet ner mot betesmarken som sträcker sig ned mot Boren med fina utblickar. Slingan är röjd och markerad. Det går lätt att gå hela slingan men den är lite stenig och kuperad på delar. Vid slutet kommer man fram till vindskyddet med grillplats.\n\nMan kan från vindskyddet följa trädstigen för barn upp till parkeringen så blir det en fin rundslinga på totalt cirka 800 m.\n\nNaturreservatet förvaltas av Motala kommun. Vi undanber cykling på reservatslederna. Det är på många platser en känslig mark i reservatet. Stigarna blir också väldigt lätt leriga och blöta.\n\n'
