EXECUTE insert_trail( E'Katastrofleden 2021'
                    , E'Katastrofleden: en vandringsled, utställning, koreografi och upptäcksfärd genom Vallentuna, där (katastrof)tankarna får vandra fritt.\n\nIdag möter vi många berättelser om kriser och katastrofer i samhället. Vi är mitt uppe i en pandemi som har förändrat våra levnadssätt och förhållningssätt till varandra. Vi får ständigt nya rapporter om klimatförändringar, ett sjätte massutdöende och många människor som är på flykt undan krig och katastrofer. Hur känner jag inför allt detta, vad kan jag göra för att påverka och bidra till demokrati och samhällsutveckling?\n\nKatastrofleden bjuder in dig till en vandring genom olika miljöer, en estetisk upplevelse under en milslång naturnära \'koreografi\'. Du ges möjlighet att låta tankarna göra sällskap med dina steg, känna efter för att lufta katastroftankar och utforska vad som kan hjälpa i möte med förändringar och osäkerhet.\n\n### \n\n**ETAPPER OCH STATIONER PÅ KATASTROFLEDEN**\n\nKatastrofleden är öppen under sommaren 2021. Den består av olika etapper och du kan välja att gå delar eller hela leden.\n\n1. Vallentuna C - Molnby ca 9 km\n2. Molnby - Lindholmen ca 11 km\n3. Lindholmen - Frösunda ca 9 km\n4. Frösunda - Kårsta ca 15 km\n\nLeta efter en informationssymbol i Naturkartan för starten på varje etapp. Utmed leden i Naturkartan finns också stationerna du går förbi markerade med symboler.\n\n**PACKLISTA**\n\nFör att ta del av hela Katastrofleden kan det vara bra att packa med sig:\n\n- matsäck\n- vatten att dricka (mer än du tror)\n- varma (och eventuellt vattentäta) kläder och ombyte\n- skavsårsplåster\n- powerbank till mobilen (den används en hel del för att ta del av stationerna längs med vägen och för att följa kartan)\n- hörlurar till mobilen (för att kunna lyssna till olika ljudspår)\n- badkläder och handduk?\n- eventuella personliga läkemedel\n- skrivbok och penna?\n\nFör dig som vill övernatta är det också bra att ha med sig:\n\n- tält/tarp\n- sovsäck\n- underlag\n- tandborste, tandkräm\n- eventuellt badkläder och handduk?\n- eventuella personliga läkemedel\n- kanske en skrivbok och penna?\n\nTänk på att inte använda produkter som förorenar naturen och att ta med allt skräp.\n\n'
