EXECUTE insert_trail( E'Östgötaledens rundslingor vid Ullaberg och Mossen'
                    , E'Vid Ullaberg och Mossen finns Linköpings nyaste fågelsjöar. Runt våtmarkerna finns några fina rundslingor. Rundslingorna är en del av Östgötaleden och hänger ihop med etappen mellan Vidingsjö och Bjärka Säby. Väljer du den längsta slingan blir vandringen drygt fyra kilometer lång, men du kan också välja kortare etapper. Längs leden finns flera rastplatser och fina utsiktspunkter. Östgötaleden är markerad med orangefärgade ledmarkeringar. Rundslingorna är markerade med en orange kvadrat.\n\n'
