EXECUTE insert_trail( E'Kornamossen - vandringsled rundslinga'
                    , E'I Kornamossens naturreservat finns en fin rundslinga där du vandrar ömsom längs vattnet, ömsom genom högrest skog. Bortom träden skymtar ängsmarker. Det är gott om vilt och olika fåglar sjunger. På spänger vandrar du över själva Kornamossen, där kortväxta, krumma tallar och tuvull ger en överraskande stark norrlandskänsla. Doften av skvattram är stark.\n\nI området finns flera kolbottnar. De är rester från den tid då torparen var ålagd att leverera kol till stångjärnssmidet i Rånäs bruk. Här finns också spår av gamla vintervägar. Informationsskyltar berättar.\n\nBara några hundra meter från parkeringen, vid Kornans strand, finns en rast- och grillplats. Möjlighet till bad från klippan.\n\nLeden är ej tillgänglighetsanpassad. Terrängen är kuperad och det kan bitvis vara riktigt blött i markerna. (Spänger tar dig över de blötaste passagerna, men räkna med att vattentäta skor är en bra idé.)\n\nRundslingan är drygt 3 km lång med möjlighet att gena.\n\n'
                    , E'#7f532a'
