EXECUTE insert_trail( E'Östgötaleden - Motala runt'
                    , E'Leden ”Motala runt” tar dig verkligen runt Motala och visar upp Sjöstaden från sin bästa sida med natur och historiska platser längs vägen. För den som mest är ute efter att vandra långt fungerar den bra som rundslinga. Vill man göra flera stopp och se sig omkring längs vägen fungerar det bra att dela upp vandringen på två dagar. Följ bara Östgötaledens orangefärgade markering så bjuds det på en vandring med variation.\n\nHär får man stifta nära bekantskap med Göta kanal och gamla Motala verkstadsområde som uppkom vid kanalbygget. Motala hamnområde med sitt stadsnära läge och fortsatt vandring längs med Vättern. Fritidsområdena Råssnäs och Mariebergsudden där vandringen går längs Vättern på mjukare underlag med vindpinade tallar och ekar. Varamobaden, nordens största insjöbad där markeringen följer den långa sandstranden innan stadsvandring mot höjden och naturområdet Bondebacka. Sveriges Rundradiomuseum och de för Motala så karaktäristiska Radiomasterna innan nedgång mota Göta kanal igen.\n\nFör den som vill se lite mer av Göta kanals historia kan man koppla på Östgötaleden 1,2 km mot Borenshults slussar som går förbi Mallbodens Café & vandrarhem. Borenshults slussar är Göta kanals brantaste slusstrappa och här slussar man i fem slussar till eller från sjön Boren.\n\n**Matställen:** Mallbodens café & Vandrarhem, Hamnkrogen, Restaurang Wetternmagasinet, Rönnerdahls (Motormuseum), Sjöbris, Vättershall, Sjövik, Ubbes bageri, Pizzeria Sorento, Lilla hembageriet. (Slusskiosken & Cafe & Grill Motala slussar vid Borenshult anslutande led)\n\n**Toaletter:** Stora torget ovanför Motala hamn, Råssnäsbadet, Råssnäs, Pariserviken, Varamon 2st\n\n**Sevärdheter:** Göta kanal, Motala Industrimuseum, Motala Motormuseum, Sveriges Rundradiomuseum, (Borenshults slussar vid anslutande led )\n\n**Boenden:** Mallbodens café & Vandrarhem, Hotell Östermalm, Hotell Nostalgi, Best Western hotell Statt Hotell city, Furulid (Hotell Karl Friman)\n\n**Ställplatser:** Mal