EXECUTE insert_trail( E'Sododalen – Sonfjällets hjärta, Sonfjället'
                    , E'I Sododalen, som ligger i Sonfjällmassivets centrum, kantas ån Sodan av fjälltimotej, hässlebrodd, fjällkåpa, ängssyra, rödblära, skogsnäva, lundarv och torta. Här trivs också många fåglar, bland andra strömstare och drillsnäppa. Utgå från parkeringsplatsen nedanför Nysätern, eller vid själva Nysätern, och gå vidare upp mot Gråsidan och Sododalen\n\n(7 km). För den här turen bör man avsätta en hel dag. Den som vill kan passa på att göra en topptur upp till Högfjället. Dit är det bara 2 km från raststugan. När det bär av ner i Sododalen kan man passa på att ta sig en extra titt på den sadelskåra man då har till höger om sig. På avstånd kan man även se några av skvalrännorna i Högfjällets västra sluttning och den lilla raststugan skymta nere i dalen. Väl nere i Sodans dalgång kan man njuta både av sin medhavda matsäck och av den stillhet som infinner sig i detta som man mycket väl kan kalla Sonfjällets hjärta. \n\n'
                    , E'#7f532a'
                    , ARRAY[ 'LINESTRING (13.422242 62.289287, 13.422558 62.289449, 13.423529 62.289520, 13.423868 62.289555, 13.424407 62.289810, 13.424665 62.289843, 13.425100 62.289916, 13.425432 62.290087, 13.425614 62.290323, 13.425740 62.290400, 13.426176 62.290443, 13.426986 62.290497, 13.427615 62.290565, 13.427987 62.290599, 13.428626 62.290501, 13.429544 62.290322, 13.430297 62.290217, 13.431400 62.289935, 13.431581 62.289884, 13.432185 62.289815, 13.432681 62.289654, 13.433246 62.289404, 13.433787 62.289296, 13.434489 62.289228, 13.434835 62.289126, 13.435747 62.288774, 13.436743 62.288656, 13.437628 62.288515, 13.439344 62.288300, 13.439994 62.288292, 13.440756 62.288618, 13.441740 62.288750, 13.443096 62.288902, 13.443905 62.288964, 13.444502 62.289031, 13.445307 62.289168, 13.445824 62.289227, 13.446372 62.289294, 13.446920 62.289383, 13.447477 62.289594, 13.447924 62.289750, 13.448569 62.289848, 13.449344 62.289932, 13.449846 62.289945, 13.450129 62.290440, 13.451331 62.290763, 13.452840 62.291408, 13.453738 62.291327, 13.455377 62.291655, 13.456976 62.291839, 13.457897 62.291925, 13.459163 62.292264, 13.461625 62.292692, 13.465152 62.292973, 13.466202 62.293068, 13.469608 62.293159, 13.472853 62.292907, 13.473744 62.292630, 13.473777 62.292947, 13.476802 62.292845, 13.480402 62.292634, 13.482121 62.292373, 13.488106 62.291221, 13.493916 62.290649, 13.496737 62.289765)']::geography[]);

EXECUTE insert_trail( E'Vindskyddet vid Stor-Ryvålen, Sonfjället'
                    , E'En fin heldagstur runt Lill­ och Stor­Ryvålen gör man genom att först följa stigen som går ner mot Valmen. Stigen delar sig vid ett par tillfällen och man håller då till höger hela tiden. Efter cirka 7 km når man det vindskydd som ligger alldeles bredvid en av småtjärnarna på Stor­Ryvålen. Därifrån fort­ sätter man i riktning mot fjället tills man kommer fram till den stig som leder antingen tillbaka till Nyvallen (3,5 km) eller till Nysätern (6,5 km). Den första delen av stigen går mest genom högvuxen och vacker gammal skog. Stigen går ibland också över magra och torra tallhedar. I några av de fuktigare sänkorna växer jungfru Marie nycklar och spindel­ blomster skymtar här och var i granskogen. Uppe på Stor­ Ryvålen har man en fantastisk utsikt över Sonfjällsmassivets nordöstra sida. Innan man kommer fram till vindskyddet passerar man några mindre tjärnar. Är vädret bra kan man \n\nta sin fikapaus där istället för vid vindskyddet där utsikten inte är lika enastående. Stigen tillbaka till Nyvallen följer fjällkanten genom fjällbjörkskogen. Höga smörblommor och skogsnävor tävlar med tortan om att synas bäst i fjällbjörk­ skogens yppiga grönska. \n\n'
