EXECUTE insert_trail( E'Upplev Långhundraleden'
                    , E'Följ med på en virtuell guidning med kanot längs Långhundraleden. Du kommer att få ta del av historien bakom denna 10 000 år gamla transportled. Samtidigt kommer du få uppleva vacker natur och fridfull paddling.\n\nDen virtuella guidningen startar vid Toftesta Holme och slutar vid Vada Sjökullar. På den 4,4 km långa sträckan finns 9 olika stationer (A-I) med olika teman. Det kommer att finnas frågor att reflektera över längs vägen. Några är lite simplare, andra går in mer på djupet.\n\nGuidningen riktar sig främst till barnfamiljer, men stationerna är utformade så att alla ska kunna lära sig något utav dem. Turen innehåller något för alla, stora som små, unga som gamla.\n\n'
                    , E'#7f532a'
                    , ARRAY[ 'LINESTRING (18.260655 59.558667, 18.259709 59.558207, 18.259135 59.557318, 18.258105 59.557407, 18.257625 59.557628, 18.256851 59.558571, 18.256183 59.559002, 18.255157 59.559395, 18.254142 59.559706, 18.253223 59.560064, 18.251219 59.561117, 18.250466 59.561395, 18.249787 59.561707, 18.249137 59.561726, 18.248514 59.561694, 18.247893 59.561577, 18.246864 59.561544, 18.245769 59.561564, 18.243912 59.561707, 18.243200 59.561720, 18.242058 59.561590, 18.240168 59.561506, 18.239669 59.561590, 18.238687 59.561973, 18.237939 59.562181, 18.236803 59.562638, 18.233703 59.563416, 18.231769 59.563874, 18.229580 59.564438, 18.227824 59.564692, 18.226766 59.564679, 18.225792 59.564815, 18.225411 59.564943, 18.224648 59.565362, 18.224036 59.565549, 18.222656 59.565925, 18.222321 59.566101, 18.220264 59.567569, 18.219984 59.567874, 18.219519 59.568668, 18.219262 59.568906, 18.218489 59.569508, 18.218203 59.569807, 18.217887 59.570225, 18.217149 59.571273, 18.216962 59.571747, 18.216745 59.572614, 18.216513 59.572981, 18.215660 59.573851, 18.215117 59.574218, 18.214469 59.574693, 18.214083 59.574858, 18.213187 59.575129, 18.212831 59.575361, 18.212690 59.575608, 18.212601 59.575816, 18.212468 59.576046, 18.212103 59.576477, 18.211964 59.576766, 18.212016 59.576889, 18.212353 59.577241, 18.212379 59.577525, 18.212345 59.577667, 18.212015 59.578855, 18.211748 59.579198, 18.210890 59.580014, 18.210346 59.581008)']::geography[]);

EXECUTE insert_trail( E'Östgötaleden - Sjöbo-Knäppan, Charlottenborg'
                    , E'Rekommenderad startplats är vid Slaggbron, där beskrivningen utgår ifrån eller från naturreservatet Sjöbo-Knäppans parkering. Eftersom det är en rundslinga kan man givetvis börja var som helst på slingan. Från början av 1800-talet fram till 1961 kördes slagg, rester från Motala verkstads metalltillverkning, över bron och tippades på slaggbacken på andra sidan. Slaggbron går över Motala ström, precis innan utloppet till sjön Boren. Bron är en utmärkt plats att följa naturens skiftningar ifrån. Vandringen går genom Sjöbo-knäppans naturreservat som ligger sjönära. En utsiktsplattform är placerad alldels vid stranden där det framför allt vintertid är rikt på sjöfåglar, även havsörns syns regelbundet patrullera längs med Motala ström och Boren. Hela reservatet ligger på gammal kulturmark och har brukats som betes- och slåttermark sedan lång tid tillbaka. Första delen av vandringen, från slaggbron till ”gröna plan” är tillgänglighetsanpassad.\n\n”Gröna plan” är en plats dit Motalaborna redan i början av 1900-talet tog med sina matsäckskorgar till. Här kan man bada i knäppaviken, en badbrygga finns. Här finns också en grillplats. Vid Sjöbo-torpet finns toalett. Sträckan mellan slaggbron och parkeringen efter Sjöbo-torpet är tillgänglighetsanpassad. Ett fågeltorn finns för den som vill spana på fåglar över Borens vass.\n\nI det vattennära läget går man sedan på spänger som går igenom sumpskog och fram till ett kalkrikkärr, Hulthagekärret, som är plats för kalkälskare däribland många orkidéer. Här kan man i årstidsordning hitta bland annat majviva, flugblomster, vaxnycklar, blodnycklar, den "köttätande" tätörten, kärrknipprot och slåtterblomma.\n\nVandringen fortsätter på olika storlekar på småvägar med hus och hagar och slutligen på större stig där man går en längre stäcka genom åkermark för att sedan komma ut på skogsväg. Märkningen visar sen på en längre grusväg genom åkermark som mynnar ut i ett bostadsområde, Ekenenäs. Sista sträckan går på stig i skog där man strax är framme vid slaggbron.\n\n'
                    , E'#7f532a'
